INSERT INTO `noti` (`id`, `json`) VALUES
(4, '{"titulo":"Otra noticia ","editor":"Omar","fecha":"31-10-12","imagen":{"url":["0_DSC_0165_500.jpg"]},"noticia":"A partir del 3 de octubre de 2012 se instrument\\u00f3 en el sistema inform\\u00e1tico de la AFIP la opci\\u00f3n que permite anular una DJAI que se encuentre en estado de \\"observada\\", siempre que haya transcurrido el plazo de 30 d\\u00edas desde el momento en que qued\\u00f3 en esa situaci\\u00f3n.\\r\\n\\r\\nSe refiere a aquella que por diversos motivos perdi\\u00f3 inter\\u00e9s para el importador o fue sustituida por otra, quedando sin efecto la operaci\\u00f3n que se pretend\\u00eda realizar.\\r\\n\\r\\nEsta herramienta tiene por objeto el sinceramiento de los antecedentes de cada importador, a  fin de que subsista s\\u00f3lo aquella solicitud que se mantiene en vigencia.","canVisita":18}'),
(5, '{"titulo":"Otra noticia ","editor":"Omar","fecha":"31-10-12","imagen":{"url":["22_DSC_0092_500.jpg"]},"noticia":"A partir del 3 de octubre de 2012 se instrument\\u00f3 en el sistema inform\\u00e1tico de la AFIP la opci\\u00f3n que permite anular una DJAI que se encuentre en estado de \\"observada\\", siempre que haya transcurrido el plazo de 30 d\\u00edas desde el momento en que qued\\u00f3 en esa situaci\\u00f3n.\\r\\n\\r\\nSe refiere a aquella que por diversos motivos perdi\\u00f3 inter\\u00e9s para el importador o fue sustituida por otra, quedando sin efecto la operaci\\u00f3n que se pretend\\u00eda realizar.\\r\\n\\r\\nEsta herramienta tiene por objeto el sinceramiento de los antecedentes de cada importador, a  fin de que subsista s\\u00f3lo aquella solicitud que se mantiene en vigencia.","canVisita":9}'),
(6, '{"titulo":"Ultima","editor":"Omar","fecha":"31-10-12","imagen":{"url":["22_DSC_0092_500.jpg","23_DSC_0114_500.jpg","globo.jpg"]},"noticia":"A partir del 3 de octubre de 2012 se instrument\\u00c3\\u00b3 en el sistema inform\\u00c3\\u00a1tico de la AFIP la opci\\u00c3\\u00b3n que permite anular una DJAI que se encuentre en estado de \\"observada\\", siempre que haya transcurrido el plazo de 30 d\\u00c3\\u00adas desde el momento en que qued\\u00c3\\u00b3 en esa situaci\\u00c3\\u00b3n. Se refiere a aquella que por diversos motivos perdi\\u00c3\\u00b3 inter\\u00c3\\u00a9s para el importador o fue sustituida por otra, quedando sin efecto la operaci\\u00c3\\u00b3n que se pretend\\u00c3\\u00ada realizar. Esta herramienta tiene por objeto el sinceramiento de los antecedentes de cada importador, a fin de que subsista s\\u00c3\\u00b3lo aquella solicitud que se mantiene en vigencia.\\r\\n","canVisita":5}'),
(7, '{"titulo":"Normas de Seguridad del nuevo billete de $100 ","editor":"1","fecha":"18-01-13","imagen":{"url":["35_evita.jpg","35_evita.jpg"]},"noticia":"La C\\u00e1mara Argentina de Comercio recibi\\u00f3 el 7 de enero a funcionarios de la Casa de la Moneda, quienes se reunieron con Jos\\u00e9 Claver\\u00eda (Director CAC), Osvaldo Scasserra (Gerente General) y Gabriel Molteni (Economista Jefe).\\r\\n\\r\\nEl objetivo de este encuentro fue entregar material impreso y digital con informaci\\u00f3n sobre las medidas de seguridad con que cuentan los nuevos billetes de 100 pesos \\"Eva Per\\u00f3n\\", para que el sector del Comercio tome conocimiento de las mismas y pueda preveer las medidas precautorias del caso para asegurarse su legitimidad.\\r\\n\\r\\n\\r\\n","canVisita":2}');
INSERT INTO `noticia` (`id`, `imagenes_id`, `editores_id`, `fecha`, `titulo`, `noticia`, `canVisita`) VALUES
