(225, 23, 10, 'ACER DE 19 X193 V+ 1680X1050', 0, 0, 0, '      NUEVA LINEA 12 meses', 1, 'X193Wb - 19'''' Wide \r\nLa llamativa pantalla plana panorámica de 19 ofrece precio y funcionamiento óptimos. Utiliza las últimas tecnologías de imagen como control de contraste adaptable y ratio de respuesta rápida para un funcionamiento impecable. Ambas características, junto con la conexión digital son ideales para un entretenimiento dinámico y un texto bien definido para su lectura excepcional. El monitor X193Wb asegura una comodidad de visión para su uso continuo, sin producir vista cansada. Su dise&ntilde;o adquiere un estilo contemporáneo en cualquier espacio.  \r\n \r\n\r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\nResolución nativa\r\n 1680x1050\r\n \r\nContraste1\r\n 2000:1\r\n \r\nAngulo visible horizontal1\r\n 160°\r\n \r\nAngulo visible vertical1\r\n 160°\r\n \r\nBocinas integradas\r\n No\r\n \r\nConector de se&ntilde;al\r\n VGA\r\n \r\nBrillantez1\r\n 300 cd/m2\r\n \r\nTiempo de respuesta1\r\n 5ms\r\n \r\nFuente de poder\r\n Interna\r\n \r\nColor\r\n Negro\r\n \r\n\r\n', 4),
