(45, 21, 11, 'MULTIFUNCION HP C5280 IMPRIME CD LCD 2,3', 0, 0, 30, '                                      GARANTIA OFICIAL HP DE 1 A&Ntilde;O', 1, 'CARACTERISTICAS Personalice sus CD y DVD con sus propias fotos y texto. Restaure fotos antiguas y da&ntilde;adas con la tecnologi&shy;a de escaneo y el software HP incluidos. Haga copias ni&shy;tidas y claras y realice reimpresiones fotograficas increi&shy;bles con el toque de un boton. Edite, imprima y comparta fotos facilmente usando el software HP Photosmart Essential incluido. Optimice la calidad de la impresion y el copiado en diversos tipos de papel con el sensor automatico de tipo de papel. Imprima fotos facilmente sin un PC usando las ranuras para tarjetas de memoria, una pantalla de 2,4 pulgadas y HP Photosmart Express. Imprima fotos sin cambiar el papel: la bandeja automatizada para fotografias entra en funcionamiento cada vez que imprime fotos. Toque el boton de eliminacion de ojos rojos de HP para eliminar con facilidad los ojos rojos de sus fotos. Obtenga impresiones mas economicas y realice menos cambios de cartucho con los nuevos cartuchos de inyeccion de tinta de alta capacidad. Imprima lo que ve: la impresion HP Smart Web le garantiza paginas web utiles sin bordes cortados.', 4),
