ible con especificaciones USB 2.0) <br />\r\nPuertos IO externos 1 USB mini-B <br />\r\n<br />\r\n<strong><font color="#800080">Memoria</font></strong> <br />\r\nRanuras de memoria 1 ranura, compatible con Secure Digital (SD) hasta 8 GB <br />\r\n<br />\r\n<font color="#800080"><strong>General</strong></font> <br />\r\nCable en caja Sí, 1 USB <br />\r\nCompatibilidad de tarjetas de memoria Secure Digital (SD) y Secure Digital High Capacity (SDHC) <br />\r\nSoftware incluido Software HP Photosmart para Windows y Macintosh <br />\r\n<br />\r\n<font color="#800080"><strong>Requerimientos de sistema </strong></font><br />\r\nRequerimientos Macintosh, Mínimos Mac OS X v 10.3.9, v 10.4; procesadores PowerPC G3, G4 y G5 o procesador Intel Core ;128 MB RAM mínimo, 256 MB recomendado (requerido para Mac OS X v 10.4); 250 MB de espacio disponible en disco rídigo; USB integrado <br />\r\nCompatible con Mac Sí <br />\r\n</font></p>', 4),
(103, 58, 6, 'LASER XEROX PHASER 3124 MONOCROMATICA', 0, 0, 0, '   GARANTIA OFICIAL DE 1 A&Ntilde;O EN XEROX', 1, 'Prestaciones principales  \r\nhasta 24 ppm \r\nTiempo de salida de la primera página: tan sólo 9 segundos \r\nProcesador de 150 MHz. \r\nEl tama&ntilde;o máximo de papel es el Legal (216 mm x 356 mm). \r\nCapacidad estándar de papel: 251 hojas \r\nCalidad de imagen: 1200 x 600 \r\nMemoria de 8 MB \r\nCiclo máximo de trabajo de 20.000 hojas mensuales. \r\nDimensiones (a x p x h): 358 x 298 x 253 mm\r\nVentajas sobre la competencia  \r\nMayor velocidad de impresión que los productos de la competencia, para una mayor productividad. \r\nCartucho de impresión más grande que el de los productos de la competencia, para trabajar con menos interrupciones. \r\nMayor capacidad de papel que los productos de la competencia para imprimir más sin interrupciones. \r\nMayor ciclo de trabajo que los productos de la competencia\r\nFunciones para ahorrar tiempo  \r\nAlta velocidad de hasta 24 ppm que permite mantener la productividad. \r\nTiempo de calentamiento rápido, inferior a 15 segundos, para comenzar a trabajar de inmediato. \r\nFácil instalación con sólo cuatro clics para comenzar de inmediato. \r\nVeloz tiempo de salida de la primera página de tan sólo 9 segundos, sin necesidad de espera entre documentos cortos.\r\n \r\n\r\n\r\n \r\n\r\nFunciones que facilitan el uso  \r\nDise&ntilde;o peque&ntilde;o y compacto ideal para adaptarla a su escritorio. \r\nBandeja de papel grande que admite hasta 250 hojas y permite imprimir varios documentos sin interrupción. \r\nMonitor de estado Xerox que emite alertas cuando hay problemas en la impresión. \r\nPóster, que permite imprimir un documento de una sola cara en 9 páginas, que pueden unirse y, así, obtener un póster.\r\n \r\n\r\n\r\n \r\n\r\nFunciones que agregan valor  \r\nEconómica, incluso para los presupuestos más reducidos. \r\nConstrucción confiable y resistente con un alto ciclo de trabajo de hasta 20.000 páginas por mes. \r\nLa función Cancelación de trabajo permite ahorrar tóner y papel al cancelar rápidamente un trabajo incorrecto. \r\nSelección automática de bandeja para que no sea necesario indicar a la impresora en qué bandeja están los sobres, ya que lo determina por sí sola e imprime el trabajo correctamente al primer intento.\r\n \r\n\r\n \r\n\r\n \r\n', 0),
(104, 58, 6, 'LASER XEROX 4118 MONOCROMATICA', 0, 0, 0, '', 1, 'Visión general de la WorkCentre&#8482; 4118 \r\nModelo 4118P 4118X \r\nFunciones estándar Copia, Impresión Copia, Impresión, Escaneado, Fax \r\nConectividad USB, Parallel, 10/100 BaseT Ethernet (opcional) USB, Parallel, 10/100 BaseT Ethernet (opcional) \r\nGestor de documentos Opcional Estándar \r\n\r\n\r\nPrestaciones principales  \r\n - Póngase en contacto con un distribuidor para convenir opciones de pago flexibles. \r\n- Estándar (4118p): Copia, Impresión\r\n- Estándar (4118x): Copia, Impresión, Escaneado, Fax\r\n- hasta 17 ppm\r\n- Conexión en red opcional\r\n- Tama&ntilde;o máximo de papel: 216 x 356 mm/A4\r\n- Copiado e impresión a doble cara estándar\r\n- Resolución de impresión: hasta 1200 x 1200 ppp\r\n- Capacidad estándar de papel: 650 hojas\r\n- Capacidad máxima de papel: 1200 hojas\r\n- Alimentador automático de documentos con capacidad para 40 hojas\r\n- Escanea en color directamente al PC\r\n- Fax de 33,6 Kbps con compresión JBIG\r\n- Dise&ntilde;o (A x P x H): 560 x 430 x 455 mm\r\n\r\n \r\n\r\nVentajas sobre la competencia  \r\n - Mayor velocidad de impresión que los productos de la competencia, \r\n- para aumentar su productividad.\r\n- Mayor capacidad de papel de su clase, con 650 hojas estándar y 1.200 como máximo.\r\n- Más memoria de fax que los productos de la competencia, \r\n- que permite guardar más páginas en la memoria.\r\n- Mayor ciclo de trabajo que los productos de la competencia, \r\n- que otorga durabilidad y confiabilidad.\r\n- Mayor rendimiento del cartucho de tóner que la competencia, \r\n- con menos intervenciones y menor costo por página.\r\n- Interfaz de dispositivo externo (por ej: accionado con monedas o lector de tarjeta) \r\n- no incluida en los productos de la competencia.\r\n\r\n \r\n\r\nFunciones para reducir costos \r\n - Reduzca los costos operativos y las llamadas al servicio técnico \r\n- adquiriendo un solo dispositivo, en lugar de cuatro.\r\n- Ahorre en costos de papel gracias a la impresión a dos caras.\r\n- Compresión JBIG para faxes, con una eficacia del 20-80% que \r\n- acelera las transmisiones de forma significativa.\r\n- Ahorre más espacio en la oficina al escanear los documentos de \r\n- archivo en cómodos archivos PDF.\r\n\r\n \r\n\r\nFunciones para ahorrar tiempo  \r\n - Alta velocidad de hasta hasta 17 ppm y tiempo de salida de la primera \r\n- página de tan sólo 10 segundos que mantienen la productividad.\r\n- Gran capacidad de papel de hasta 1.200 hojas, que admite tareas largas y\r\n- grupos de trabajo muy activos.\r\n- Escaneado de documentos en color o blanco y negro directo al PC, \r\n- donde puede editarlos, organizarlos y enviarlos por correo electrónico.\r\n- Fax de alta velocidad de tan sólo 3 segundos por página, que reduce la duración de la llamada. \r\n- También incluye el envío de fax en color.\r\n\r\n \r\n\r\nFunciones que facilitan el uso  \r\n - Sencillo panel de control que brinda acceso fácil y directo a las funciones \r\n- y características más usadas.\r\n- Tama&ntilde;o compacto, para ubicarla en cualquier lugar de la oficina, \r\n- en un escritorio o en el soporte de gabinete opcional.\r\n- Administre, configure y solucione problemas con facilidad desde un \r\n- navegador web con el software CentreWare&reg; IS incluido en el kit de red opcional.\r\n- Reconocimiento óptico de caracteres y software Image Editing que \r\n- permiten convertir imágenes en documentos de texto.\r\n\r\n \r\n\r\nSoftware de flujo de trabajo  \r\nDigitalice...\r\nOrganice... Distribuya...\r\nColabore... \r\n Con documentos digitales, se puede crear, buscar, volver a usar y modificar sus documentos. Incremente sus inversiones con el innovador software de flujo de trabajo de Xerox y de los socios comerciales de Xerox, y podrá: \r\n\r\nControlar costos;\r\nCompartir conocimientos;\r\nAcelerar el flujo de trabajo;\r\nIntegrar papel y documentos electrónicos;\r\nAdministrar y distribuir documentos eficazmente.\r\n\r\n \r\n', 0),
(107, 58, 6, 'MULTIFUNCION XEROX 3119 FOTOC. MONOCROMT', 0, 0, 0, '           GARANTIA OFICIAL DE 1 A&Ntilde;O EN XEROX', 1, 'Prestaciones principales  \r\n - Copia, Impresión, Escaneado\r\n- hasta 18 ppm\r\n- Tiempo de salida de la primera página: tan sólo 11 segundos\r\n- Tama&ntilde;o máximo de papel: 216 x 356 mm/A4\r\n- Capacidad de papel: 251 hojas\r\n- Resolución de impresión y copia: 600 x 600 ppp\r\n- Escanea en color directamente al PC\r\n- Software de escaneado Nuance&reg; PaperPort&reg;\r\n- Compatible con plataformas PC y Mac\r\n- Tama&ntilde;o (A x P x H): 409 x 362 x 232 mm\r\n\r\n \r\n\r\nFunciones para reducir costos  \r\n - Reúne varios dispositivos de copiado, impresión y escaneado personal en una sola solución compacta.\r\n- Escanea y organiza documentos con el software de escaneado y administración de archivos más reciente, Nuance&reg; PaperPort 10.0.\r\n- Dise&ntilde;o resistente, con un ciclo de trabajo de hasta 10.000 páginas mensuales.\r\n- Compatibilidad con las normas de Energy Star, que permite ahorrar costos en energía.\r\n- Copiado de dos páginas en una cara, que permite incluir dos páginas copiadas en una hoja y, de esta forma, ahorrar papel y tóner.\r\n- Impresión de varias páginas en una cara, que permite imprimir hasta 16 páginas en una cara y, de esta forma, ahorrar papel y tóner.\r\n\r\n\r\n \r\n\r\nFunciones para ahorrar tiempo  \r\n - Rápido tiempo de calentamiento y de salida de la primera página.\r\n- Escaneado de documentos en color o blanco y negro directo al PC.\r\n- Realización de trabajos grandes gracias a la bandeja de papel con capacidad para 250 hojas.\r\n- Fácil de instalar, con un conector USB (cable USB incluido).\r\n- Fácil de mantener, con un solo cartucho de tóner que permite imprimir hasta 3.000 páginas.\r\n- Copia hasta 99 hojas en un sólo trabajo.\r\n- Copiado de documentos de identidad, que permite copiar ambos lados de un documento de identidad o un documento peque&ntilde;o en una sola hoja, y ahorrar papel 