(152, 78, 69, 'DISPOSITIVO DE SEGURIDAD PARA LAPTOPS', 0, 0, 0, '', 1, 'Computrace Lojack for Laptops es un software basado en un sistema de medios de rastreo y localización de Laptops y Desktops robadas. \r\n\r\nCuando una computadora esta protegida con este sistema, el software instalado en la laptop trabaja en forma silenciosa y segura en contacto con nuestro centro de monitoreo. En caso de aviso de robo se activa el sistema utilizando conexión a internet.\r\n \r\n \r\n&iquest;Cómo funciona? \r\nCon un simple llamado se activa el sistema y cuando la laptop robada se conecta a Internet procedemos al rastreo y localización de la misma. Se activa una se&ntilde;al de alarma y comienza a emitirla cada 15 minutos, permitiendo a nuestro Equipo de Recupero rastrear la localización de la laptop con mayor exactitud.\r\n\r\n \r\n', 0),
