(200, 21, 11, 'hp DESKJET  2460', 0, 0, 0, '', 1, ' Obtenga un extraordinario rendimiento completo: imprima a una velocidad de hasta 30 ppm en negro y de 23 ppm en color, más la tranquilidad de la fiabilidad galardonada de HP. Obtenga una impresión de páginas más asequible con los cartuchos de tinta de repuesto de alta capacidad. \r\n\r\nImprima fácilmente y con eficacia mediante funciones de gran comodidad. Imprima lo que vea con la impresión HP Smart Web printing. Transfiera imágenes a su PC a través del puerto USB frontal. Gestione sus suministros de tinta gracias a la pantalla de estado, el modo automático de tinta de reserva y el botón único para imprimir y cancelar. \r\n\r\nImprima páginas web, documentos, fotografías y más, con esta impresora flexible. Obtenga resultados que mantienen la calidad del texto y el color y son resistentes a la decoloración. Imprima fotografías estándares y con tama&ntilde;os personalizados en colores realistas y personalice las etiquetas de CD y DVD. \r\nFunciones inteligentes:\r\n- Bandejas de papel estándar: 1\r\n- Tama&ntilde;os personalizados de soporte: De 77 x 127 mm a 216 x 356 mm\r\n- Tama&ntilde;os estándares de soporte: A4 (210 x 297 mm); A5 (148 x 210 mm); DL (110 x 220 mm); C6 (114 x 162 mm); A6 (105 x 148 mm); 130 x 180 mm, 100 x 150 mm\r\n- Capacidad de entrada máxima (hojas): Hasta 80\r\n- Capacidad de salida estándar (hojas): Hasta 50\r\n- Puertos de E/S externos: 1 interfaz USB (compatible con las especificaciones USB 2.0)\r\n- Opciones de impresión a doble cara: Manual (soporte para driver suministrado)\r\n- Memoria máxima: Memoria integrada\r\n- Memoria de serie: Memoria integrada\r\n- Manejo de papel estándar/entrada: Bandeja de entrada de 80 hojas\r\n- Manejo de papel estándar salida: Bandeja de salida de 50 hojas\r\n- Ciclo de trabajo (mensual, A4): Hasta 1000 páginas por mes\r\n\r\n', 8),
(202, 21, 11, 'HP Photosmart 3110', 0, 0, 0, ' 12 meses Oficial', 1, 'Posee un panel de control ajustable a diferentes posiciones. \r\nPantalla LCD color de 2.5" para ver, seleccionar y editar tus fotos sin necesidad de usar una PC. Y podés imprimir las fotos mediante puerto Pictbridge o ranuras de tarjetas de memoria, sin necesidad de la PC \r\nImpresión a 6 tintas con cartuchos individuales, con la nueva tecnología de reciclado de tinta. \r\n', 9),
