(337, 23, 11, 'MONITOR Compaq Presario wf1907', 0, 0, 10, '', 1, 'Características <br />\r\nEl monitor LCD de pantalla ancha Compaq Presario wf1907 posee las siguientes características: <br />\r\nResolución de fábrica de 1440 x 900 <br />\r\nEntradas de video admitidas: <br />\r\nSe&ntilde;al analógica VGA <br />\r\nSe&ntilde;al digital DVI-D <br />\r\nCapacidad Plug and Play, si el sistema del equipo la admite <br />\r\nMenú en pantalla (OSD) de ajustes para facilitar la optimización de la configuración y visualización de la pantalla. <br />\r\nEn conformidad con Energy Star <br />', 6),
(338, 81, 11, 'COMBO HP COMPACT WF1907', 0, 0, 20, '   3 a&ntilde;os', 1, '<p><strong><font color="#800080">Características </font></strong><br />\r\nEl monitor LCD de pantalla ancha Compaq Presario wf1907 posee las siguientes características: <br />\r\nResolución de fábrica de 1440 x 900 <br />\r\nEntradas de video admitidas: <br />\r\nSe&ntilde;al analógica VGA <br />\r\nSe&ntilde;al digital DVI-D <br />\r\nCapacidad Plug and Play, si el sistema del equipo la admite <br />\r\nMenú en pantalla (OSD) de ajustes para facilitar la optimización de la configuración y visualización de la pantalla. <br />\r\nEn conformidad con Energy Star </p>\r\n<p><font color="#800080"><strong>ESPECIFICACIONES DE LA SINTONIZADORA</strong></font> Experimente una amplia resolución de pantalla LCD 1440x900 (16:9) LCD TV Box Frecuencia de exploración avanzada que aumenta la tecnología para alcanzar 60Hz o 75Hz la cual entrega cuadros estables sin parpadeo. <br />\r\n<br />\r\n*Compatible con VGA 800x600, XGA 1024x768, SXGA (1280x1024), WXGA 1440x900 <br />\r\n<br />\r\nFrecuencia de exploración avanzada que aumenta la tecnología para alcanzar 60Hz o 75Hz la cual entrega cuadros estables sin parpadeo. Mantiene una proporción de la imagen 4:3/1 6:9 9/16 <br />\r\n<br />\r\nFunción de canal previo para facilitar la selección de canal <br />\r\n<br />\r\nConexion Para Ps2 DVD Vhs Pc Etc <br />\r\n<br />\r\nExcelente función de reducción de ruidos del cuadro 3D para hacer una imagen mas estable y clara. <br />\r\n<br />\r\nFunción especial PIP: el tama&ntilde;o y la posición de la ventana son ajustables. Control Remoto completo y altavoz incorporado <br />\r\n<br />\r\nEl despliegue en ingles y chino del efecto 3D del menú facilita las operaciones. <br />\r\n<br />\r\nLa interfaz de la entrada AV/S-VIDEO/YPbPr puede ser extendida usando el mini cable para poder conectar el producto con DVD, PS2, etc. <br />\r\n<br />\r\nEl producto soporta la definición estándar y alta definición de la se&ntilde;al de entrada (480I/ 480P/ 576I/ 576P/ 720P). Funciones auxiliares tales como subir la potencia automáticamente o cerrar dentro de las 24 horas, calendario, calculadora, juegos, etc. <br />\r\n</p>', 3),
