(34, 23, 10, 'ACER 19 DVI 1680X1050 5MS MONTABLE', 0, 0, 20, '             GARANTIA DE 1 A&Ntilde;O', 1, 'Especificaciones Tecnicas Acer 19&quot; AL1916wAbd Widescreen LCD Monitor Tama&ntilde;o y tipo de pantalla 19&quot; Wide thin flim transitor Resolucion 1440X900 Tecnologia de panel TN + film Brillo 300 cd/m2 Color 16.7M Ratio de contraste 700:1 Tiempo de respuesta 5 ms Frecuencia Horizontal 24~80KHZ Frecuencia Vertical 56~60HZ Angulo de vision Horizontal 150Â&deg; Angulo de vision Vertical 135Â&deg; Se&ntilde;al de video Analog (D-sub) y DVi DIGITAL Modos soporte video VGA, SVGA, XGA, SXGA, NEC, Apple y VESA Plug &amp; Play DDC1 &amp; DDC2B Energia del sistema VESA DPMS On:36W Standby:2W Off:1W (max.) Entrada de energi&shy;a Adaptador Interno AC 100 - 240 VAC, 50/60 Hz Controles del panel frontal brillo, contraste, posicion de la imagen, frecuencia del reloj del pixel, ajuste y seleccion del color, 5 modos de idioma, Reset, power on/off sw,power led,funcion +/-,ajuste +/-, ajuste automatico TEXTO FOTO ETC Tilt &amp; RotaciÃ³n de la base Tilt: +5Â&deg; ~ -25Â&deg;, Swivel: +45Â&deg; ~ -45Â&deg; Peso Net : 4kgs Dimensiones (WXHXD) 462 x 385x 180mm Wallmount (VESA) Soportado, 75mm X 75mm Kensington Lock soportado Certificaciones UL, CUL, TUV/GS, T-Mark, ISO9241-3/-7/-8, FCC/B, VCCI, CE, TCO99, C-tick,BSMI,WHQL, ISO 13402-6', 5),
