(269, 31, 65, 'MP4 Titan US-021 2Gb', 0, 0, 50, '', 1, 'Nuevo Titan MP4 pantalla LCD 2 pulgadas de 65.000 colores, con un nuevo estilo de dise&ntilde;o,capacidad 2Gb expandible. Reproduce multiples formatos de audio y video, radio FM stereo y grabacion de voz. Bateria recargable de 8hrs de reproduccion continua. Expandible con memorias Mini-SD  ', 10),
