(101, 55, 11, 'CAMARA DIGITAL HP PHOTOSMART M447 5MP', 0, 0, 0, '         GARANTIA OFICIAL DE 1 A&Ntilde;O EN HP.', 1, '<p><font size="1"><strong><font color="#800080">Diferenciador de producto</font> <br />\r\n</strong>Diferenciador de producto 5 MP, zoom óptico de 3x, zoom digital de 5x, eliminación de ojos rojos líder del sector[1] y pantalla de 2,4 pulgadas <br />\r\n<br />\r\n</font><font size="1"><font color="#800080"><strong>Resolución</strong> <br />\r\n</font>Profundidad de bit 36 bits <br />\r\nResolución 2576 x 1920 pixeles <br />\r\n<br />\r\n<strong><font color="#800080">Tecnología</font> </strong><br />\r\nTecnología de imagen Color, Compensación EV, Modo rápido, Calidad de imagen, Velocidad ISO, Equilibrio de blancos <br />\r\n<br />\r\n<strong><font color="#800080">Funciones</font></strong> <br />\r\nControl de exposición Medición de exposición automática centralizada (AE) <br />\r\nSensibilidad de exposición Automático (predeterminado), ISO 100, 200, 400, 800 (con HP Steady Photo) <br />\r\nCapacidad de enfoque Normal (predeterminado), macro <br />\r\nFunciones de control de imagen Apagado, impresión solamente fecha, impresión fecha y hora <br />\r\nEspecificaciones de pantalla LCD Visor color de LCD brillante de 6 cm visible en interiores/exteriores <br />\r\nSistema de lente Lente de precisión HP; zoom total de 15x (3x óptico, 5x digital); f2.7 (gran angular); f4.8 (teleobjetivo) <br />\r\nObturador mecánico 2 a 1/1500 seg <br />\r\nModos de fotografía Automático (predeterminado), Close Up, Foto estable, Teatro, Paisaje, Retrato, Acción, Retrato a la noche, Puesta de sol <br />\r\n<font color="#800080"><strong>Modos de disparo</strong></font> Autotemporizador desactivado (predeterminado), Autotemporizador, Modo burst (ráfaga), Video <br />\r\nVisor Ninguno <br />\r\nCapacidad de zoom Zoom total de 15x (3x óptico, 5x digital) <br />\r\n<br />\r\n<font color="#800080"><strong>Conectividad</strong></font> <br />\r\nConectividad estándar 1 USB (compat