(137, 80, 40, 'EPSON POWERLITE S5 2000 LUMENES', 0, 0, 0, '', 1, 'Proyector liviano y portátil ideal para presentadores dinámicos. Incluye arranque instantáneo en 4 segundos, para evitar retrasos en tus presentaciones.\r\nFunción de búsqueda de fuente muestra automáticamente la(s) fuente(s) de entrada conectada(s) y cambia instantáneamente entre varias fuentes.\r\nA/V Mute Slide, cubierta de lente deslizable para controlar mejor tus presentaciones.\r\nInnovadora función Instant Off? ? Te permite apagar y desenchufar el proyector inmediatamente después de tu presentación.\r\nProyección de gran tama&ntilde;o, económica y simple para disfrutar de DVD?s y juegos de video con colores y detalles sobresalientes. Listo para HDTV ? puede usarse con formatos tradicionales y de pantalla grande (4:3/16:9).\r\nFunciones de seguridad protegidas por clave, incluyendo timer, protección de logotipo y bloqueo de teclas para evitar el robo o el acceso no autorizado. \r\n\r\n \r\nNIVEL DE RUIDO  35 dB (alta luminosidad) \r\n28 dB (baja luminosidad) \r\n \r\nBRILLO/ LUMENS  2.000 Ansi lúmenes  \r\nRESOLUCIÓN NATIVA  SVGA 800x600 Pixeles  \r\nCONTROL REMOTO  Seleccion de fuente, encendido, aspecto, modo de color, volumen, e-zoom, A/V mute, congelar, menu, pagina arriba y abajo, ayuda, auto.  \r\nCONTRASTE 400:1  \r\nCORRECIÓN DE TRAPECIO  Vertical +/- 30 grados  \r\nHUMEDAD DE OPERACIÓN  15% a 85% \r\nSISTEMA DE PROYECCIÓN  Tecnología 3LCD de Epson  \r\nMETODO DE PROYECCIÓN  Proyección frontal, posterior, inversa y del techo  \r\nLENTES F-number = 1,4 Zoom Digital 1,0 - 1,35 Foco Manual  \r\nLAMPARA  170 W UHE, 3000 H (alta luminosidad), 4000 (baja luminosidad)  \r\nTV COMPATIBLE  Compatible con la televisión de alta definición HDTV: 480i, 480p,720p, 1080i  \r\nREPRODUCCIÓN DE COLORES  24bits - 16,7 millones de colores  \r\nTARJETA DE SONIDO  10 Watt  \r\nDISTANCIA DE PROYECCIÓN  0,87 mts a 12,12 mts  \r\nCARACTERISTICAS FISICAS  Ancho: 32,8 cm Profundidad: 24,5 cm Alto: 10,0 cm Peso: 2,