(173, 71, 10, 'COMBO TV LCD ACER DE 24', 0, 0, 0, '', 1, 'Monitor Acer AL 2416 WBSD  \r\nResolucion Maxima  1920x1200 \r\nVelocidad de refresco  5 MS GTG \r\nMontable a la pared  Si, con base desmontable  \r\nConexiones VGA 15 pines\r\n\r\nDVI-D \r\n \r\nColor  Plata Negro \r\nPulgadas 24" \r\nTecnoligia Display  LCD \r\nFormato de display  Widescreen \r\nAngulo de Vision  160&ordm; \r\nContraste Real  1000:1  \r\nBrillo  400 nits  \r\nPeso  9.1 Kg con caja 12.5Kg \r\nCables Incluidos  1 Cable Power 220V 1 Cable VGA 1 Cable DVI  \r\nGarantia 1 a&ntilde;o  \r\nSintonizadora Externa  Kworld Tv Box 1440  \r\nESPECIFICACIONES DE LA SINTONIZADORA\r\n Experimente una amplia resolución de pantalla LCD 1440x900 (16:9) LCD TV Box  \r\nFrecuencia de exploración avanzada que aumenta la tecnología para alcanzar 60Hz o 75Hz la cual entrega cuadros estables sin parpadeo. \r\n*Compatible con VGA 800x600, XGA 1024x768, SXGA (1280x1024), WXGA 1440x900  \r\nFrecuencia de exploración avanzada que aumenta la tecnología para alcanzar 60Hz o 75Hz la cual entrega\r\ncuadros estables sin parpadeo.  \r\nMantiene una proporción de la imagen 4:3/1 6:9 \r\n9/16 Función de canal previo para facilitar la selección de canal \r\nConexion Para Ps2 DVD Vhs Pc Etc  \r\nExcelente función de reducción de ruidos del cuadro 3D para hacer una imagen mas estable y clara. \r\nFunción especial PIP: el tama&ntilde;o y la posición de la ventana son ajustables. \r\nControl Remoto completo y altavoz incorporado \r\nEl despliegue en ingles y chino del efecto 3D del menú facilita las operaciones. \r\nLa interfaz de la entrada AV/S-VIDEO/YPbPr puede ser extendida usando el mini cable para poder conectar el \r\nproducto con DVD, PS2, etc. El producto soporta la definición estándar y alta definición de la se&ntilde;al de entrada (480I/ 480P/ 576I/ 576P/ 720P). \r\nFunciones auxiliares tales como subir la potencia automáticamente o cerrar dentro de las 24 horas, calendario, calculadora, juegos, etc. \r\nLa función para ordenar el número de canales, le permite ordenar los programas como sus favoritos. \r\nInterruptor de cambio de banda ancha de PC/TV (200MHz). \r\n \r\nContenido del Combo Monitor: 1 Cable Power, 1 cable Vga, 1 cable DVI\r\n\r\nSintonizadora: 1 cable Svideo Video Audio RCA, 1 Cable componente, 1 cable de audio mini jack 3.5mm, 1 cable RCA video, 1 control remoto, 1 trafo 220V a 5V, 1 base.\r\n \r\nComentarios Adicionales  Los monitores Lcd tiene una definicion superior a las Tvs Lcd ya que estan fabricados para soportar mayores exigencias de las Pc, lo cual le da una calidad de imagen excelente. Ademas los Tvs LCd se fabrican con una velocidad de respuesta de 15Ms a 8Ms lo cual le quita calidad cuando se los exige con imagenes pesadas, cosa qu een los monitores de 5MS eso no ocurre. \r\n', 0),
