(263, 29, 46, 'PC TO TV WIRELESS', 0, 0, 30, '      GARANTIA OFICIAL DE 2 A&Ntilde;OS.', 1, 'KWorld presento su producto Wireless PC to TV, con el cual podremos ver y escuchar en nuestro TV lo que estemos viendo en nuestro PC, consola o DVD, ya sea una película o un video, fotos, etc. Sin necesidad de algún cable.\r\n\r\nHasta 3 receptores pueden ser controlados con un solo emisor gracias a la tecnología Wireless 2.4G. El PC TO TV Wireless funciona exitosamente con cualquier equipo que utilice el estándar VGA, no importa si es Mac o si es un Dell, HP, IBM o cualquier otro equipo basado en Windows PC.\r\n\r\nCaracterísticas\r\n# Transmisor inalámbrico con se&ntilde;al de entrada de AV y PC\r\n# Frecuencia ISM 2.4G\r\n# Transmite hasta cuatro se&ntilde;ales de canales 2.4G para su elección\r\n# Control remoto del PC con un ratón con conexión PS2\r\n# Habilita la se&ntilde;al de VGA al estándar de la se&ntilde;al de TV PAL o NTSC\r\n# Ajuste de brillo/contraste/saturación/color\r\n# Ajuste del tama&ntilde;o de la ventana\r\n# Ajuste automático de la se&ntilde;al de VGA\r\n# Resolución máxima de 1024*768@85Hz\r\n# Sencilla conexión Plug And Play', 4),
(264, 29, 46, 'MEDIA SENDER WIRELESS', 0, 0, 20, ' GARANTIA OFICIAL DE 2 A&#209;OS', 1, 'Su hogar totalmente comunicado\r\nDisfrute de su Sintonizador Satélite, DVD, TDT, &#8230; en cualquier televisión del hogar\r\nCon Media Sender Wireless podrá utilizar el propio mando a distancia de su producto\r\npara cambiar de canal, reproducir su DVD, &#8230; en cualquier televisión de la casa.\r\nHasta 3 receptores pueden ser controlados con un solo emisor. Tecnología Wireless 2.4G de última generación.\r\nTodo lo que tiene que hacer es conectar su emisor PC TO TV Wireless a su equipo y conectar sus receptores PC TO TV Wireless a los productos de audio y video.\r\nMedia Sender Wireless es la solución perfecta para no tener duplicidad de productos en su hogar.\r\nSin drivers, y sin instalaciones complicadas, totalmente autónomo. Funciona con el propio mando a distancia de su Satélite, DVD, VHS, TDT, &#8230;\r\nCon KWorld Media Sender Wireless se liberará de todos los enredos provocados por los cables, y tendrá acceso ilimitado a sus equipos del hogar!\r\nSin los problemas de la instalación de software! KWorld Media Sender Wireless usa tecnología inalámbrica 2.4G para atravesar las paredes sin tener que usar cables!\r\nSincronice su Sintonizador Satélite, DVD, TDT, ... Con KWorld Media Sender Wireless disfrutará de libertad con una se&#241;al clara en todos los puntos de su casa.\r\nConecte estos productos directamente en el dispositivo, y podrá disfrutar de una imagen nítida sin el problema de los desórdenes de cables!', 5),
(271, 42, 52, 'TP-LINK USB ADAPTER 54 M WIRELESS', 0, 0, 60, '', 1, 'Descripción\r\nCumpliendo con IEE802.11g, el WN321G posee tecnología de transmisión WLAN ?Super G?, dando como resultado velocidades de transmisión de hasta 54M. El WN620G posee seguridad multi protección. Cumpliendo con encriptación WEP 64/128/152-bit, WPA, IEEE802.1X, TKIP y AES, el WN620G posee habilidades de comunicación súper seguras. Con un poderoso firewall protege a la red de intrusos. Con antena interna puede trabajar en diferentes ambientes y deja a los usuarios conectarse a la red de manera fácil y rápida. También es compatible con Seamless Roaming y es compatible con otros equipos WLAN 11b, 11g\r\n\r\nEspecificaciones\r\nCumple con IEEE802.11g, IEEE802.11b \r\nPosee tecnología de transmisión WLAN TP-LINK Super G?, velocidad de transmisión auto negociable, hasta 54M \r\nConector USB tipo A (hembra \r\nPosee encriptación WEP de 64/128/152-bit \r\nSoporta WPA, IEEE802.1X, TKIP, AES \r\nSoporta Windows 98SE, Me, 2000, XP \r\nPosee un programa simple de configuración y supervisión \r\nSoporta modos de infraestructura Ad-Hoc \r\nSoporta roaming wireless \r\n', 12),
(272, 29, 46, 'Sinto.Tv y FM Pciexpress x1 Pe360a C/Rem', 0, 0, 20, '', 1, 'Caracteristicas Dise&ntilde;o de bajo perfil e interfaz \r\nPCI Express. \r\n  Entrada adicional AV / S-Vídeo, \r\ncomo CVBS, S-Video, Component \r\nconector (480i/480p) y SPDIF \r\n[Opcional] para la conexión\r\na otras fuentes de vídeo (como \r\nreproductor de DVD / VCD / VHS / \r\nCamcorder). \r\n  Detección y decodificación \r\nestandar totalmente automática de \r\nTV analógicos (PAL, NTSC, y SECAM), \r\nformatos de transmision\r\nestéreo (A2, NICAM, BTSC con DBX T, \r\nSAP, y EIAJ) y radio FM. \r\n  Hipermedia Center software: \r\ninterfaz de facil uso con poderosas \r\nfunciones \r\n  Auto búsqueda de canales y \r\nreconocimiento de nombre \r\n  Múltiples canales de \r\nprevisualización \r\n  Aumento de 16:9, 16:10 en formato \r\nWide. \r\n  TV / vídeo siempre en la parte \r\nsuperior de la pantalla del monitor \r\n  Ajuste Brillo / Contraste / \r\nSaturación / Hue \r\n  Soporta cambio de tiempo y la \r\nfunción de grabación programada. \r\n  Soporta la captura fija de \r\nimagenes en formato BMP o JPEG.\r\n  \r\nGarantia oficial de 2 a&ntilde;os \r\n', 13),
(273, 29, 46, 'Editora y Capturadora DVD MAKER PCI', 0, 0, 30, '', 1, 'Alguna vez se ha sentido frustrado por culpa\r\n de un disco duro averiado?? \r\nCon el grabador de DVD PCI de KWORLD, puede grabar esos archivos antes de que desaparezcan.. Sus funciones incluyen captura, confección y grabación por quemado de cualquier vídeo desde cualquier fuente de vídeo tales como DVD Player / VCD / VHS /Camcorder. \r\nPuede incluso hacer grabación directa al DVD\r\n sin utilizar espacio extra de disco duro.', 14),
(274, 29, 46, 'Editora y Capturadora de Video Usb Kworl', 0, 0, 20, '', 1, 'Caracteristicas Interfaz USB 2,0 \r\n  Detección automática NTSC / PAL \r\n  Captura vídeos de VHS, V8, Hi8. \r\n  Salida como un archivo para iPod \r\no PSP que puede publicar \r\ndirectamente a You Tube \r\n  Permite la grabación directa de \r\nDV a DVD a través de CyberLink \r\nPowerProducer 4. \r\n  Soporta la grabación con solo un \r\nbotón cuando usted está bajo el \r\nmodo de captura PowerDirector V6. \r\n  Edite vídeos en formato MPEG \r\n4/2/1 (MPEG4 es compatible con DivX \r\no Microsoft MPEG4) (Nota: usted \r\ntiene que descargar el\r\ncodec de MPEG por usted mismo.) \r\n  Resolución de vídeo:\r\n1. NTSC: 720 x 480 @ 30 FPS\r\n2. PAL: 720 x 576 @ 25 FPS \r\nGarantia oficial de 2 a&ntilde;os \r\n', 15),
(275, 29, 46, 'Video Kworld Pc To Tv ideal para ver en', 0, 0, 25, '', 1, 'Caracteristicas Soporta Multi-Sistemas de TV NTSC \r\n& PAL . \r\n  No necesita software, pero \r\nconecta la PC directamente con la \r\ntelevisión. \r\n  Máxima resolución 1024 x 768 @ \r\n75Hz \r\n  Pantalla ajustables: posición de \r\npantalla, brillo, contraste, \r\ndefinición y tono. \r\n  Entrada y salida AV y S-Vídeo al \r\nmismo tiempo. \r\n  No necesita adaptador: Interfaz \r\nde conexión USB 2.0. \r\n  Soporta el modo de ahorro de \r\nenergía DPMS que es compatible con \r\nla placa de video. \r\n  Consumo de poder: DC5V- 350mA \r\n  Resoluciones:\r\n\r\n640 x 480: 60 / 72 / 75 / 85 Hz\r\n800 x 600: 60 / 72 / 75 / 85 Hz\r\n1024 x 768: 60 / 72 / 75 / 85 Hz\r\n  \r\n  Video Output: AV, S-Video, VGA \r\nOutput \r\n  NTSC/PAL Switch Function: NTSC \r\n(Default). \r\nGarantia OFICIAL DE 2 A&Ntilde;OS \r\n \r\n \r\n \r\n  \r\n \r\n', 16),
(276, 29, 46, 'Sintonizadora Captura de Tv  Kworld IPTV', 0, 0, 30, '', 1, 'Caracteristicas Interface USB 2.0 \r\n  Video Input \r\n  TV Input \r\n  75 Ohm (UHF/VHF) TV Antenna \r\n  Composite Input RCA jack \r\n  S-Video 4-pin Mini-Din \r\n  Audio Input \r\n  RCA L/R \r\n  TV Receiving Frequency \r\n  NTSC \r\n  55.25  855.25 MHz \r\n  PAL 48.25  863.25 MHz \r\n  Dimension 104mm(L) X 32mm(W) X 19mm(H) \r\nGarantia OFICIAL DE 2 A&Ntilde;OS \r\n', 17),
(277, 29, 46, 'PC to TV Converter KW-PCTV-1600', 0, 0, 30, '', 1, 'Con el conversor de TV en PC de KWorld podes conectar tu PC a la TV de manera eficiente. No exhibas mas tus trabajos o veas tus peliculas para PC en una peque&ntilde;a pantalla, hacelo en tu TV y con la mejor resolución, hasta 1600x1200, sin comparacion con la calidad deprimente de las salidad de TV de las placas de video convencionales.\r\nEl conversor de TV en PC de KWorld podras tambien aplicar distintos efectos a tus trabajos desde el control remoto, como ser: zoom o pan, highlight o freeze.\r\n\r\n', 18),
