(299, 82, 71, 'TV LCD SONY BRAVIA 52" FULL HD 52W300A', 0, 0, 2, '', 1, 'Resolución de pantalla: Full HD - 1920 x 1080 píxeles Formato de pantalla 16:9  \r\n&#8231;  Incorporates Sony unique BRAVIA ENGINE Ex &#8211; features a process to up-scale Standard Definition inputs to High Definition quality by quadrupling the number of pixels in the image. Incorpora Sony BRAVIA único MOTOR Ex - características de un proceso a escala de Definición Estándar aportaciones a la calidad de Alta Definición por cuadruplicado el número de píxeles en la imagen. With powerful Digital Image Engine, innovatively uses full digital video integrated processing - to create better gradations and details, enhance contrast, dynamically improve color, and reduce image flicker Con potente motor de Imagen Digital, innovadora utiliza plenamente digital de procesamiento de vídeo integrado - para crear una mejor gradación y los detalles, mejorar el contrario, mejorar dinámicamente color, y reducir el parpadeo de la imagen  \r\n', 0),
