(347, 21, 7, 'multifuncion TX300F', 0, 0, 50, '      ', 1, 'Tecnología de Impresión EPSON Micropiezo punto variable <br />\r\nImpresión a 4 colores (CMYK) <br />\r\n<br />\r\n<br />\r\nResolución Hasta 5760 x 1440 dpi de resolución <br />\r\n<br />\r\n<br />\r\nVelocidad de Impresión Hasta 31 ppm en texto negro y 15 ppm en texto a color <br />\r\n<br />\r\n<br />\r\nTama&ntilde;o de la gota 4 picolitros <br />\r\n<br />\r\n<br />\r\nNúmero de inyectores Monocromática: 90 boquillas (K) <br />\r\nColor: 29 boquillas x 3 (CMY) <br />\r\n<br />\r\n<br />\r\nArea de impresión Máxima: 21,6cm (8,5&quot;) (ancho) x 111 cm (44&quot;) (largo) <br />\r\nBorderFree?: 4&quot;x6&quot;, 5&quot;x7&quot;, 8&quot;x10&quot;, y carta <br />\r\n<br />\r\n<br />\r\nAlimentación de papel Hojas sueltas <br />\r\n<br />\r\n<br />\r\nTama&ntilde;o de papel Carta, Oficio (21,6 x 35,6cm), A4, B5, A5, A6, informe, ejecutivo, media carta, definido por el usuario: (8,9 a 21,6 cm) x (8,9 a 111,7cm) <br />\r\nSobres: No. 10, DL, C6 <br />\r\n<br />\r\n<br />\r\nTipos de papel Común, bond, papel recubierto, papel con acabado mate, papel con acabado brillante y semibrillante, autoadhesivo y otros <br />\r\n<br />\r\n<br />\r\nCapacidad de entrada de papel Bandeja de entrada: 120 hojas / 10 sobres <br />\r\n<br />\r\n<br />\r\nInterfaces USB 2.0 (High Speed, también compatible con USB 1.1) <br />\r\n<br />\r\n<br />\r\nVisor Pantalla LCD de 2 líneas de texto <br />\r\n<br />\r\n<br />\r\nEscáner <br />\r\n<br />\r\n<br />\r\n<br />\r\nTipo de escáner Escáner a color de cama plana <br />\r\n<br />\r\n<br />\r\nFuente de luz Lámpara fluorescente de cátodo frío <br />\r\n<br />\r\n<br />\r\nDispositivo fotoeléctrico Sensor de líneas CIS <br />\r\n<br />\r\n<br />\r\nResolución de Escáner Optica: 1200x2400 dpi <br />\r\nMáxima: 9600 dpi <br />\r\n<br />\r\n<br />\r\nProfundidad Color de 48 bits <br />\r\n<br />\r\n<br />\r\nArea de escaneo 21,6 cm x 29,7 cm (8,5&quot; x 11&quot;) <br />\r\n<br />\r\n<br /