(343, 21, 11, 'IMPRESORA MULTIFUNCION HP F4280', 0, 0, 90, '      GARANTIA OFICAL DE 12 MESES CON HP.', 1, '<br />\r\nEsta HP Deskjet es la solución simple que está buscando. Es una impresora de inyección de tinta, rápida y accesible, que ofrece también escáner y copiadora en un sólo dispositivo. Cancele un trabajo con facilidad con el práctico botón de cancelación de impresión. Imprima texto en negro con calidad láser con las tintas HP Vivera. <br />\r\n<br />\r\n<font color="#800080"><strong>Características</strong></font> <br />\r\n<br />\r\n<br />\r\nObtenga la velocidad que necesita: hasta 26 ppm en negro y 20 ppm en color <br />\r\nImpresiones de texto de alta calidad a color y en negro con hasta 4800 dpi <br />\r\nEscanee con una resolución de 1200 x 2400 dpi <br />\r\nImprima sus fotos sin bordes en tama&ntilde;os 4 x 6 pulgadas y panorama <br />\r\nLa configuración es rápida y simple con el software y el hardware intuitivos <br />\r\nAhorre tinta y papel evitando la impresión de páginas no deseadas con el botón de cancelación de impresión <br />\r\nAmplíe o reduzca documentos y fotos con facilidad usando el botón de redimensionamiento <br />', 0),
(361, 46, 17, 'Grabadora Y Lectora De Dvd Y Cd Samsung', 0, 0, 100, ' ', 1, 'de carga por bandeja y alimentación USB <br />\r\n<br />\r\nGrabador de DVD 8x de carga por bandeja. No necesita conectarse a la corriente eléctrica ya que se alimenta a través de USB. <br />\r\nAdemás, el SE-S084B acepta discos de 12 y 8 cm. <br />\r\n<br />\r\nSoporte para Interfaz: USB 2.0 <br />\r\ncrea DVDs con títulos personalizados <br />\r\nDVD-RAM, DVD&plusmn;R DL, DVD&plusmn;R, DVD&plusmn;RW <br />\r\nfunción de expulsión manual de disco <br />\r\n<br />\r\n<br />\r\nNo necesita fuente de alimentación para expulsar el disco. <br />\r\nno necesita alimentación eléctrica; se alimenta directamente del USB <br />\r\n<br />\r\n<br />\r\nGraba: <br />\r\nDVD-RAM, DVD&plusmn;R DL, DVD&plusmn;R, DVD&plusmn;RW, CD-R, CD-RW <br />\r\nsoporte para discos de 12cm y 8cm <br />\r\n<br />\r\n<br />\r\nDisco de tipo redondo estándar de 8cm y 12cm. <br />', 7),
