(378, 81, 17, 'Tv Lcd 20 Combo Monitor + Sintonizadora ', 0, 0, 40, '', 1, '<p>Más imágenes y videos monitor LCD de 20&rdquo; <br />\r\nAvanzado e innovador monitor de 20&rdquo;, con contraste dinámico de 15000:1, resolución de 1600 x 900 y moderno dise&ntilde;o. <br />\r\nespecificaciones claves <br />\r\nTama&ntilde;o de pantalla : 20&quot; <br />\r\nResolución : 1600 x 900 <br />\r\nBrillo : 300 cd/m&sup2; <br />\r\nRadio de Contraste : DC 15000:1 (1000:1) <br />\r\n</p>\r\n<p>&nbsp;</p>\r\n<p>ESPECIFICACIONES DE LA SINTONIZADORA Experimente una amplia resolución de pantalla LCD 1440x900 (16:9) LCD TV Box Frecuencia de exploración avanzada que aumenta la tecnología para alcanzar 60Hz o 75Hz la cual entrega cuadros estables sin parpadeo. <br />\r\n<br />\r\n*Compatible con VGA 800x600, XGA 1024x768, SXGA (1280x1024), WXGA 1440x900 <br />\r\n<br />\r\nFrecuencia de exploración avanzada que aumenta la tecnología para alcanzar 60Hz o 75Hz la cual entrega cuadros estables sin parpadeo. Mantiene una proporción de la imagen 4:3/1 6:9 9/16 <br />\r\n<br />\r\nFunción de canal previo para facilitar la selección de canal <br />\r\n<br />\r\nConexion Para Ps2 DVD Vhs Pc Etc <br />\r\n<br />\r\nExcelente función de reducción de ruidos del cuadro 3D para hacer una imagen mas estable y clara. <br />\r\n<br />\r\nFunción especial PIP: el tama&ntilde;o y la posición de la ventana son ajustables. Control Remoto completo y altavoz incorporado <br />\r\n<br />\r\nEl despliegue en ingles y chino del efecto 3D del menú facilita las operaciones. <br />\r\n<br />\r\nLa interfaz de la entrada AV/S-VIDEO/YPbPr puede ser extendida usando el mini cable para poder conectar el producto con DVD, PS2, etc <br />\r\n</p>', 6),
(376, 23, 17, 'Monitor Lcd 19 Samsung 943 Snx 15000:1 1', 0, 0, 30, ' ', 1, '<br />\r\nMás imágenes y videos monitor LCD de 18.5&rdquo; de pantalla amplia <br />\r\nAvanzado e innovador monitor de 18.5&quot;, con contraste dinámico de 15000:1, resolución de 1360 x 768, moderno dise&ntilde;o y tecnologías MagicBright&sup3;, color effect, customized key, MagicWizard y MagicTune, entre otras. <br />\r\nespecificaciones claves <br />\r\nTama&ntilde;o de pantalla : 18.5&quot; amplia <br />\r\nResolución : 1360 x 768 <br />\r\nBrillo : 250 cd/m&sup2; <br />\r\nRadio de Contraste : CD 15000:1 (1000:1) (typ.) <br />', 8);
