(391, 39, 11, 'Hp Compaq 515 Athlon 64 x2 2.1 ghz Webca', 0, 0, 15, '       12 meses garantia', 1, '<p><strong>Marca</strong> HP Compaq <br />\r\n<br />\r\n<strong>Modelo</strong> Compaq 515</p>\r\n<p><strong>Procesador</strong> Athlon 64 x2 2.1Ghz 1MB cache Ql64<br />\r\n<br />\r\n<strong>Memoria</strong> 1GB expandible 4GB <br />\r\n<br />\r\n<strong>Disco</strong>&nbsp;160 GB SATA 5400 RPM <br />\r\n<br />\r\n<strong>Video</strong> Ati Radeon HD3200</p>\r\n<p><strong>Tipo de Pantalla</strong> Led 14.1&quot; 1366x768 BrigthView <br />\r\n<br />\r\n<strong>Puertos</strong> (3) USB 2.0, (1) ExpressCard/34, (1) Salida VGA, (1) entrada microfono, (1) salida Auriculares, (1) RJ-45/Ethernet, <br />\r\n<br />\r\n<strong>Red</strong> RJ-45 10/100 Wireless Intel 802.11 a/b/g <br />\r\n<br />\r\n<strong>Webcam</strong> Incorporada 2 Megapixel <br />\r\n<br />\r\n<strong>Unidad Optica</strong> Lectograbadora CD y DVD + RW con tecnologia Ligthscribe <br />\r\n<br />\r\n<strong>Bateria</strong> 6 celdas <br />\r\n<br />\r\n<strong>Lector Tarjetas</strong> Modulo de lectura tarjeta tipo SD <br />\r\n<br />\r\n<strong>Sistema</strong> <strong>Operativo</strong> FreeDos <br />\r\n<br />\r\nDrivers XP y Vista <br />\r\n</p>', 0),
(375, 80, 7, 'Combo Sudafrica 2010 Epson S6 ', 0, 0, 15, '              ', 1, '<p>PROYECTOR EPSON+ PANTALLA DE 84&rdquo;+ TV BOX1680 + SOPORTE PARA PANTALLA+ BARRIL DE CERVEZA HEINEKEN</p>\r\n<p>&nbsp;</p>\r\n<p><font color="#800080"><strong>Características Técnicas</strong></font> <br />\r\n<br />\r\n<br />\r\nSistema de proyección (3LCD) TFT de 0,55 pulgadas con MLA <br />\r\nÓptica <br />\r\nResolución nativa SVGA (800 x 600) <br />\r\nResolución nativa 4:3 <br />\r\nResolución admitida VGA hasta SXGA <br />\r\nLuminosidad (alta/eco) 2200 ANSI lm / 1750 lm <br />\r\nReproducción del color A todo color (16,77 millones de colores) <br />\r\nRelación de contraste 2000:1 <br />\r\nTama&ntilde;o de la pantalla De 30&quot; a 300&quot; (de 0,87 a 10,5m) <br />\r\nPantalla de 60&quot; 1,77 - 2,4m <br />\r\nCorrección Keystone Vertical: de -30 a +30 grados <br />\r\nLenteS de proyección <br />\r\nRatio de apertura 1,45 - 1,96:1 <br />\r\nTipo Zoom digital / enfoque manual <br />\r\nNúmero F 1,44 <br />\r\nDistancia focal 16,6 mm <br />\r\nTipo de enfoque/zoom Zoom manual / zoom óptico 1,35 x <br />\r\nDesplazamiento 9,6:1 <br />\r\nProtección de la lente A/V mute de tapa deslizante <br />\r\nLámpara <br />\r\nTipo 170 W UHE - E-TORL <br />\r\nDuración 4000 horas/3000 horas (alta luminosidad/modo eco) <br />\r\nEntrada <br />\r\nOrdenador 1 D-sub 15 pins (RGB) <br />\r\nVídeo 1 x D-sub 15 pins (componente) <br />\r\n1 x RCA, 1 x S-Video <br />\r\nAudio 2 x RCA (rojo/blanco) <br />\r\nPresentaciones por USB / Control 1 x USB tipo B <br />\r\nSalida <br />\r\nOrdenador 1 D-sub 15 pins (RGB) 1 D-sub 15 pins (RGB) <br />\r\nAltavoz integrado 1 W monoaural <br />\r\n</p>', 0),
(385, 39, 11, 'Compaq Presario CQ40-300LA 3 GB', 0, 0, 10, '  ', 1, 'Procesador, sistema operativo y memoria <br />\r\nTipo de procesador <br />\r\nProcesador Intel&reg; Celeron&reg; 585 <br />\r\n&bull; 2,16 GHZ, <br />\r\n<br />\r\nSistema operativo instalado <br />\r\nWindows Vista&reg; Starter original <br />\r\n<br />\r\nMemoria :&nbsp;3 GB <br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\nTipo de memoria <br />\r\nDDR2 <br />\r\n<br />\r\nUnidades internas <br />\r\nUnidades internas <br />\r\n160 GB <br />\r\n<br />\r\nControlador de almacenamiento <br />\r\nUnidad de disco duro SATA <br />\r\n<br />\r\nVelocidad de la unidad de disco duro <br />\r\n5400 RPM <br />\r\n<br />\r\nTipo de unidad óptica <br />\r\nUnidad DVD&plusmn;RW 8x SuperMulti con tecnología LightScribe compatible con doble capa <br />\r\n<br />\r\nCaracterísticas del sistema <br />\r\nMódem <br />\r\nMódem de alta velocidad 56K <br />\r\n<br />\r\nInterfaz de red <br />\r\nLAN Ethernet 10/100BASE-T integrada (conector RJ-45) <br />\r\n<br />\r\nPuertos externos de Entrada/Salida <br />\r\n3 USB 2.0, 1 RJ-11, 1 RJ-45, 1 salida auricular/Estéreo, 1 entrada micrófono, 1 HDMI, 1 VGA <br />\r\n<br />\r\nTama&ntilde;o de pantalla <br />\r\nPantalla Widescreen WXGA de alta definición HP BrightView de 14,1 pulgadas de diagonal <br />\r\n<br />\r\nResolución de pantalla <br />\r\n1280 x 800 <br />\r\n<br />\r\nNombre de subsistema de gráficos <br />\r\nIntel Graphics Media Accelerator 4500M (compartido) <br />\r\n<br />\r\nAdaptador de video, bus <br />\r\nHasta 268MB de memoria de gráficos total disponible <br />\r\n<br />\r\nWebcam <br />\r\nWebcam con micrófono integrado <br />\r\n<br />\r\nAltavoces y micrófono <br />\r\nAltavoces Altec Lansing&reg; <br />\r\n<br />\r\nTeclado <br />\r\n101 key compatible <br />\r\n<br />\r\nTipo de fuente de alimentación <br />\r\nAdaptador de CA de 65W <br />\r\n<br />\r\nDispositivo apuntador <br />\r\nPanel táctil con botón de activación/desactivación y zona de desplazamiento ascendente/descendente vertical exclusiva <br />\r\n<br />\r\nTipo de batería <br />\r\nLitio-Ion de 6 celdas (47Whr) <br />\r\n<br />\r\n<br />', 2),
(394, 39, 0, 'Lenovo 3000 G530 Dual Core 2.0Ghz 250GB', 0, 0, 10, '12 meses oficial Lenovo', 1, '<p>Nueva Lenovo 3000 G530<br />\r\nMarca Lenovo<br />\r\n<br />\r\n<strong>Modelo</strong>&nbsp;Lenovo 3000 G530&nbsp;<br />\r\n<br />\r\n<strong>Procesador</strong> Dual Core T4200 2.0 Ghz cache 1MB <br />\r\n<br />\r\n<strong>Memoria</strong> 1GB expandible 4GB <br />\r\n<br />\r\n<strong>Disco</strong> 250 GB SATA 5400 RPM <br />\r\n<br />\r\n<strong>Video</strong> Intel&nbsp;4500 <br />\r\n<br />\r\n<strong>Tipo de Pantalla</strong> Led 15.4&quot;&nbsp;1280x800 BrigthView <br />\r\n<br />\r\n<strong>Puertos</strong> (4) USB 2.0, (1) ExpressCard/34, (1) Salida VGA, (1) entrada microfono, (1) salida Auriculares, (1) RJ-45/Ethernet, <br />\r\n<br />\r\n<strong>Red</strong> RJ-45 10/100 Wireless Intel 802.11 a/b/g <br />\r\n<br />\r\n<strong>Webcam</strong> Incorporada&nbsp;1.3 Megapixel <br />\r\n<br />\r\n<strong>Unidad Optica</strong> Lectograbadora CD y DVD + RW</p>\r\n<p><strong>Bateria</strong> 6 celdas <br />\r\n<br />\r\n<strong>Lector Tarjetas</strong> Modulo de lectura tarjeta 4 en 1<br />\r\n<br />\r\n<strong>Sistema Oprativo</strong> FreeDos <br />\r\n<br />\r\nDrivers XP y Vista <br />\r\n<br />\r\n</p>', 0),
