INSERT INTO `ost_email_template` (`tpl_id`, `cfg_id`, `name`, `notes`, `ticket_autoresp_subj`, `ticket_autoresp_body`, `ticket_notice_subj`, `ticket_notice_body`, `ticket_alert_subj`, `ticket_alert_body`, `message_autoresp_subj`, `message_autoresp_body`, `message_alert_subj`, `message_alert_body`, `note_alert_subj`, `note_alert_body`, `assigned_alert_subj`, `assigned_alert_body`, `ticket_overdue_subj`, `ticket_overdue_body`, `ticket_overlimit_subj`, `ticket_overlimit_body`, `ticket_reply_subj`, `ticket_reply_body`, `created`, `updated`) VALUES
(1, 1, 'Plantilla por defecto', 'Plantillas por defecto', 'Ticket Abierto [#%ticket]', '%name,\r\n\r\nLa consulta ha sido recibida y tiene asignado el siguiente ID #%ticket. Uno de nuestros representates respondera a tu solicitud entre 24 y 72 horas.\r\n\r\nPuedes consultar el progreso de tu ticket en linea desde este enlace: %url/view.php?e=%email&t=%ticket.\r\n\r\nSi deseas enviar comentarios o informacion adicional sobre este tema, por favor, no abras un ticket nuevo. Simplemente ingresa a traves del enlace anterior y actualiza el ticket.\r\n\r\n%signature', '[#%ticket] %subject', '%name,\r\n\r\nNuestro equipo de atencion al usuario ha respondido tu ticket, #%ticket con el siguiente mensaje.\r\n\r\n%message\r\n\r\nSi deseas hacernos llegar informacion adicional sobre este tema, por favor, no abras un ticket nuevo. Puedes actualizar o ver en linea el progreso de este ticket en: %url/view.php?e=%email&t=%ticket.\r\n\r\n%signature', 'Alerta de Ticket Nuevo', '%staff,\r\n\r\nNuevo Ticket #%ticket creado.\r\n-------------------\r\nNombre: %name\r\nEmail: %email\r\nDpto: %dept\r\n\r\n%message\r\n-------------------\r\n\r\nPara ver o responder a este ticket, por favor ingresa al sistema de soporte.\r\n\r\n- Tu sistema de soporte amigable - potenciado por osTicket.', '[#%ticket] Mensaje Recibido', '%name,\r\n\r\nTu respuesta a la consulta de soporte #%ticket se ha recibido.\r\n\r\nPuedes ver el progreso de tu ticket en linea desde: %url/view.php?e=%email&t=%ticket.\r\n\r\n%signature', 'Alerta de Nuevo Mensaje', '%staff,\r\n\r\nHa recibido un mensaje para el ticket #%ticket\r\n\r\n----------------------\r\nNombre: %name\r\nEmail: %email\r\nDpto: %dept\r\n\r\n%message\r\n-------------------\r\n\r\nPara ver o responder a este ticket, por favor ingresa al sistema de soporte .\r\n\r\n- Tu sistema de soporte amigable - potenciado por osTicket.', 'Alerta de nueva nota interna', '%staff,\r\n\r\nNota interna recibida para el ticket #%ticket\r\n\r\n----------------------\r\nNombre: %name\r\n\r\n%note\r\n-------------------\r\n\r\nPara ver o responder a este ticket, por favor ingresa al sistema de soporte.\r\n\r\n- Tu sistema de soporte amigable - potenciado por osTicket.', 'Ticket #%ticket Asignado a ti', '%assignee,\r\n\r\n%assigner te a asignado el ticket #%ticket a ti!\r\n\r\n%message\r\n\r\nPara ver o responder a este ticket, por favor ingresa al sistema de soporte .\r\n\r\n- Tu sistema de soporte amigable - potenciado por osTicket.', 'Alerta de ticket vencido', '%staff,\r\n\r\nEl ticket, #%ticket asignado a ti o tu departamento se a vencido.\r\n\r\n%url/scp/tickets.php?id=%id\r\n\r\nTodos debemos trabajar duro para garantizar que todos los tickets se estan abordando de manera oportuna. Por favor, resuelve el problema asi no recibira otro mensaje como este.\r\n\r\n\r\n- Tu sistema de soporte amigable (aunque con un grado de paciencia) - potenciado por osTicket.', 'Ticket Denegado', '%name\r\n\r\nNo se ha creado el ticket de ayuda . Has superado el numero maximo de tickets permitido.\r\n\r\nSe trata de un bloqueo temporal. Para poder abrir otro ticket, una de tus consultas pendientes debe estar cerrada. Para actualizar o agregar comentarios a un ticket abierto, simplemente ingresa a traves del siguiente enlace.\r\n\r\n%url/view.php?e=%email\r\n\r\nGracias.\r\n\r\nEl sistema de soporte', '[#%ticket] %subject', '%name,\r\n\r\nUn miembro del personal de atencion al Usuario ha respondido tu consulta con la ID, #%ticket on la siguiente respuesta:\r\n\r\n%response\r\n\r\nEsperamos que esta respuesta haya solucionado tu pregunta. Si no, por favor, accede a tu cuenta para responder o crear un ticket nuevo.\r\n\r\n%url/view.php?e=%email&t=%ticket\r\n\r\n%signature', '2013-10-17 13:21:45', '2013-10-17 13:21:45');
