INSERT INTO `ost_kb_premade` (`premade_id`, `dept_id`, `isenabled`, `title`, `answer`, `created`, `updated`) VALUES
(3, 0, 1, 'Noga', 'Gracias por comprar en Datacomputacion.\r\n\r\nSu producto marca NOGA tiene garantia oficial en la calle :\r\n\r\nAv. Larrazabal 2877 - Mataderos, en el horario de 10 horas a 17 horas, de Lunes a Viernes.\r\n\r\nGracias por su consulta.\r\n', '2013-10-22 17:12:32', '2013-10-22 17:13:35'),
(4, 0, 1, 'calificar', '\r\nRecuerde que la compra de mercado libre no esta calificada, y es requisito fundamental para que nosotros podamos realizarse los tramites ante la marca. \r\nTenga en cuenta que nosotros debemos asegurarnos que solo tramitamos garantías a clientes que concretaron la compra.\r\n\r\nFavor calificar y volver a contactarse.\r\n\r\nSaludos', '2013-11-07 17:57:25', '2013-11-07 17:57:25'),
(2, 0, 1, 'Ejemplo (con variables)', '\r\n%name,\r\n\r\nTu ticket #%ticket creado el %createdate esta en el departamento %dept .\r\n\r\n', '2013-10-17 13:21:46', '2013-10-17 13:21:46');
