(74, 117, '', '  El dia 29/10 compre y pague una notebook toshiba L845 $4199, pero me equivoque porque yo queria una de 15,6 pulgadas, llame en el acto y me dijeron que no habia problema, llame mas tarde y me dijeron que de similares carcteristicas pero de 15,6 era la ecer E1 y que la diferencia era de $451 a lo cual deposite esa diferencia, es mas puse 455, mande un mail a la direccion depositosbancarios@datacomputacion.com con los comprobantes de pago y el nuevo modelo que pretendia.  Mas tarde me llega un mail que ya recibieron el pago y que el envio esta en camino, llamo para corroborar cual notebook me facturaron y enviaron, mediante mercado libre envios y era la toshiba L 845, pregunto como solucionar esto y me dicen, que no la reciba, que la rechaze y cuando vuelva me reintegran la plata y vuelva a comprar, pero lo mas increible es se la dejaron a un vecino sin solicitar dni, papel de compra o algo, menos mal que es honesto y me la trajo, en definitiva quiero solucionar mi problema, mi pedido seria si no pueden enviar la notebook que yo pretendia y me la cambien, la plata ya esta acreditada', '', 'Web', '186.23.54.23', '2013-10-31 13:44:30', NULL),
