(154, 179, '', 'Este mail es del día 16/09, el día que llegó la tablet, y es una respuesta de Agustín a mi queja:\r\n\r\nPara comenzar su proceso y/o gestión de garantía deberá contactarse vía mail\r\ncon rma@datacomputacion.com\r\n\r\nEs requisito fundamental que la compra que realizo en MercadoLibre este en\r\nestado finalizada.(Para esto deberá calificar la misma).\r\nTenga en cuenta que si este paso no esta realizado, dicho sector no podrá\r\nresponder sus reclamos o consultas.\r\nNo olvide que la herramienta de calificación es para verificar que realmente\r\nse realizo la transacción entre las partes, \r\nno es un instrumento para tramitar garantías.\r\n\r\nDATOS QUE DEBERA ENVIAR AL MAIL RMA@DATACOMPUTACION.COM\r\n\r\nAPODO DE MERCADOLIBRE:\r\nNOMBRE O RAZON SOCIAL:\r\nDNI:\r\nDIRECCION:\r\nCODIGO POSTAL:\r\nFECHA DE FACTURA:\r\nTELEFONO DE CONTACTO:\r\nMARCA DEL PRODUCTO:\r\nMODELO:\r\nNUMERO DE SERIE:\r\nINCONVENIENTE O FALLA QUE DESEA CONSULTAR:\r\n\r\nUna vez que se reúnan estos requisitos se le asignara un numero de caso y se\r\npondrá en contacto con usted un técnico especializado.\r\n\r\nLos gastos de traslado y/o logística desde y hasta DATA COMPUTACION corren\r\npor exclusiva cuenta del cliente.\r\nDATA COMPUTACION no se responsabiliza bajo ningún concepto por beneficio\r\nperdido, lucro cesante o cualquier consecuencia \r\nderivada de la falla cubiertas por la garantía.\r\n\r\nPara que esta garantía tenga validez deberá ser acompañada por la factura de\r\ncompra.\r\n\r\n\r\n\r\nHernán Procopio\r\nData Computacion 4568-2522 INT 607\r\n\r\n\r\n-----Mensaje original-----\r\nDe: Roberto Sale [mailto:robertito.sale@gmail.com] \r\nEnviado el: lunes, 16 de septiembre de 2013 11:34 a.m.\r\nPara: agustin@datacomputacion.com\r\nAsunto: Re: Tablet Kelyx\r\n\r\nHola. Acabo de recibir la tablet Kelyx que compré la semana pasada, pero\r\nesta rota!! No funciona la pantalla tactil, se queda trabada apretando\r\nbotones sola!! No la pude ni usar! Que hago?\r\n\r\n\r