(170, 204, '', '            La imagen tiembla continuamente (No se ven estables las imágenes) hasta que pasa ratos largos con una franja de varios colores vertical que tapa a veces 1/4 otra veces 3/4 del area visible de la pantalla. Se probó cambiando el cable y el problema persiste. Se instaló otro monitor tambien VGA en la computadora que se detectó el problema para verificar problemas de señal proveniente de la placa de video, pero con otro monitor la placa de video funciona normalmente sin ninguno de los sintomas descritos anteriormente.            ', '', 'Web', '201.216.192.165', '2013-11-08 17:41:59', NULL),
(171, 205, '', 'LAS TECLAS NO COINCIDEN CON LA CONFIGURACION DE TIPEO.\r\n\r\nPOR EJEMPLO, APRETANDO LA "Ñ" APARECE EL SIMBOLO ":", EN EL "+" SALE LA TECLA "Ñ"            ', '', 'Web', '24.232.229.241', '2013-11-08 18:02:52', NULL),
(172, 206, '', 'Cuando compre la tablet pregunte si la podía usar con Skype, Hangouts, etc. Aplicaciones que usan la cámara frontal para iniciar una videoconferencia, que es la razón por la cual la compre, y así fue, funciono por estos casi 3 meses perfectamente. Ahora resulta que no funciona la cámara frontal en ninguna aplicación de videoconferencia, pero si en la aplicación cámara. Por eso mismo cuando me dirijo a Bangho a reclamar (Como ustedes me dijeron) dicen que la tablet esta "bien", que ellos no pueden asegurar que corran en la tablet aplicaciones de terceros (Esto después de que la deje 2 días en Bangho de Viamonte y me la devolvieron asegurando que funcionaba).\r\nAhora bien, un amigo tiene la misma tablet, la cual funciona perfectamente con el Skype y Hangouts. En Bangho me dicen que es tema de software, lógicamente no es de software, ya que las 2 tablets tienen el mismo software (Android y Skype).\r\nSabiendo que en Bangho me MIENTEN (Primero diciéndome que funciona perfecto que me la lleve tranquilo y después telefónicamente echándole la culpa al software Skype u otro de terceros) recurro a ustedes para que me puedan dar alguna solución lógica.', '', 'Web', '186.18.198.167', '2013-11-08 18:03:49', NULL),
