(6, 105, 117, 1, 'Maria Bagnato', 'Marcelo, buen dia\r\nCerramos el reclamo, ya que nos infromaron de administracion que acordo con atencion al cliente con el supervisor Agustin Lahitte que este sábado vendría al local.\r\nEste reclamo se cierra ya que nuestro departamento no tiene  incidencia.', '24.232.229.241', '2013-11-07 10:49:11', '0000-00-00 00:00:00'),
(4, 61, 104, 3, 'Mauricio Tous', 'HOLA, ACERCATE CON EL PRODUCTO ASI LO INGRESAMOS EN LA GARANTIA, CUANDO VENGAS MENCIONA QUE MAURICIO TE DIJO QUE NOSOTROS BUSCARIOAMOS LA FACTURA POR SISTEMA. SALUDOS', '24.232.229.241', '2013-11-04 19:01:52', '0000-00-00 00:00:00'),
(5, 120, 157, 4, 'Federico Schultz', 'cambio directo autorizado por mauricio\r\n', '24.232.229.241', '2013-11-05 11:41:45', '0000-00-00 00:00:00'),
(3, 17, 61, 3, 'Mauricio Tous', 'HOLA, ACERQUESE CON EL PRODUCTO COMPLETO ASI LE SOLUCIONAMOS EL INCONVENIENTE.\r\nSALUDO ATTE.\r\n', '24.232.229.241', '2013-11-01 13:27:44', '0000-00-00 00:00:00'),
(7, 9, 53, 1, 'Maria Bagnato', 'Buenos dias\r\nLos discos se encuentran golpeados, la garantia no lo cubre. Le enviamos los productos bajo el numero de guia yaa00842939', '24.232.229.241', '2013-11-07 11:03:08', '0000-00-00 00:00:00'),
(8, 137, 173, 1, 'Maria Bagnato', 'Ana\r\nLa garantia de tu equipo es directa con Dell.\r\nTe paso el link donde podes entrar o llamar para que te indiquen los pasos a seguir.\r\n\r\nhttp://www.dell.com/support/contents/ar/es/arbsdt1/category/Contact-Information?c=ar&l=es&s=bsd&cs=arbsdt1\r\n\r\nSaludos', '24.232.229.241', '2013-11-07 13:38:41', '0000-00-00 00:00:00'),
(9, 151, 187, 1, 'Maria Bagnato', 'Pablo, buenas tardes \r\nTenes que acercarte a la garantia oficial de Toshiba. Es en el barrio de la Boca y atienden de 09.00 a 18.00 hs.\r\nTe paso los datos completos\r\n\r\nTeknaria ServiciosCustomer Survey Rating\r\nIrala 1950 Capital Federal \r\nBuenos Aires \r\nPhone: 5173-8314\r\n\r\nPor favor recorda ir con la factura de compra, y el producto completo.\r\nsaludos', '24.232.229.241', '2013-11-07 15:31:44', '0000-00-00 00:00:00'),
(10, 152, 188, 1, 'Maria Bagnato', 'Se cierra el reclamo, ya que el telefono figura como inexistente, y el mail es el de datacomputacion.\r\nNo se puede seguir adelante con datos falsos.', '24.232.229.241', '2013-11-07 15:37:49', '0000-00-00 00:00:00'),
(11, 150, 186, 1, 'Maria Bagnato', 'Dana \r\nYa iniciamos su tramite de garantía. Para continuar sera necesario que acerque el producto a nuestro local  Av lope de vega 2983. Deberá venir con el producto completo, factura de compra e indicar en recepción el siguiente nro de tramite \r\nTicket ID114811.\r\n\r\nRecuerde que la compra de mercado libre no esta calificada, y es requisito fundamental para que nosotros le realicemos los tramites ante Genius.\r\nSaludos', '24.232.229.241', '2013-11-07 17:42:18', '0000-00-00 00:00:00'),
(12, 155, 189, 1, 'Maria Bagnato', 'Se realiza cambio de equipo en el dia de hoy 7/11/2013.\r\nAgradecemos su compra, y esperamos que este inconveniente que pudimos resolver satisfactoriamente, no tiña nuestra relación comercial.\r\nGracias por elegirnos.', '24.232.229.241', '2013-11-07 19:52:19', '0000-00-00 00:00:00'),
(13, 148, 184, 1, 'Maria Bagnato', 'Federico, buenas tardes\r\nRecuerde que la compra de mercado libre no esta calificada usuario (FRED9041), y es requisito fundamental para que nosotros podamos realizarse los tramites ante la marca. \r\nTenga en cuenta que nosotros debemos asegurarnos que solo tramitamos garantías a clientes que concretaron la compra.\r\n\r\nFavor calificar y volver a contactarse.\r\n\r\nSaludos', '24.232.229.241', '2013-11-07 20:11:59', '0000-00-00 00:00:00'),
(14, 198, 230, 1, 'Maria Bagnato', 'Osvaldo, buen dia\r\n\r\nLa impresora tiene 12 meses de garantía con Epson. \r\n\r\n\r\nPara hacer su garantía podrá llaar a Epson al  \r\n (5411) 5167-0300\r\n', '190.177.252.91', '2013-11-11 18:55:24', '0000-00-00 00:00:00'),
(15, 188, 220, 1, 'Maria Bagnato', 'Buenas tardes\r\nSu producto cuenta con 12 meses de garantía con el fabricante LENOVO.\r\nLe paso el link del soporte de Lenovo\r\n\r\nhttp://support.lenovo.com/es_AR/\r\n\r\nsaludos', '190.177.252.91', '2013-11-11 19:11:12', '0000-00-00 00:00:00'),
(16, 187, 206, 1, 'Maria Bagnato', 'Buenas tardes, estamos atendiendo su consulta. En cuanto tengamos una respuesta le avisamos.', '190.177.252.91', '2013-11-11 19:13:09', '0000-00-00 00:00:00'),
(18, 192, 224, 1, 'Maria Bagnato', 'Federico\r\n\r\nPasadas las 48hs la garantía es directa con Samsung\r\nTe paso el link del chat de Samsung para que te den soporte\r\n\r\nhttp://www.samsung.com/ar/support/model/NP900X3F-K01AR\r\ny te paso el teléfono 0800-333-3733\r\n\r\n\r\nsaludos cordidales', '190.177.252.91', '2013-11-11 19:33:35', '0000-00-00 00:00:00'),
(19, 116, 153, 5, 'Jorge Valdiviezo', 'RECIBI EL PRODUCTO COMPLETO CON CARGADOR + USB,PANTALLA RAYADA POR USO,NO ENCIENDE. RECIBIDO POR JORGE', '24.232.229.241', '2013-11-11 20:23:23', '0000-00-00 00:00:00'),
