(21, 161, 195, 1, 'Maria Bagnato', 'Puede pasar a retirar producto nuevo. Realizamos recuperación de fotos, favor venir con pendrive.', '24.232.229.241', '2013-11-12 14:22:47', '0000-00-00 00:00:00'),
