(25, 205, 237, 1, 'Maria Bagnato', 'Maria, buenas tardes\r\nPara comenzar el tramite de garantía, deberá enviar a Av lope de vega 2989 Capital federal Cp 1417.EL PRODUCTO COMPLETO CON COPIA DE FACTURA Y LA CAJA EMBALADA CON ESTE CODIGO  ID443531   \r\nPEGADA AFUERA, POR FAVOR NO ESCRIBA NI PEGUE NADA EN LA CAJA ORIGINAL DEL PRODUCTO.\r\n\r\n \r\n Recuerde que los costos de envio, son a cargo del comprador. En ningún caso Data computación podrá abonar los mismos.', '24.232.229.241', '2013-11-12 15:28:18', '0000-00-00 00:00:00'),
