nción de reducción de ruidos del cuadro 3D para hacer una imagen mas estable y clara. \r\nFunción especial PIP: el tama&ntilde;o y la posición de la ventana son ajustables. \r\nControl Remoto completo y altavoz incorporado \r\nEl despliegue en ingles y chino del efecto 3D del menú facilita las operaciones. \r\nLa interfaz de la entrada AV/S-VIDEO/YPbPr puede ser extendida usando el mini cable para poder conectar el \r\nproducto con DVD, PS2, etc. El producto soporta la definición estándar y alta definición de la se&ntilde;al de entrada (480I/ 480P/ 576I/ 576P/ 720P/ 1080I). \r\nFunciones auxiliares tales como subir la potencia automáticamente o cerrar dentro de las 24 horas, calendario, calculadora, juegos, etc. \r\nLa función para ordenar el número de canales, le permite ordenar los programas como sus favoritos. \r\nInterruptor de cambio de banda ancha de PC/TV (200MHz). \r\n \r\n', '', 0, 0, 0, 0, 'COMBO TV LCD ACER DE 19'),
