INSERT INTO `texto` (`id_texto`, `id_modulo`, `orden`, `titulo`, `texto`, `imagen`, `alineacion_imagen`) VALUES
(1, 1, 0, '', '<p>Somos una empresa dedicada a brindar soluciones en Construcciones y Servicios de Ingeniería;&nbsp; generando soluciones de vanguardia para que sus clientes sean Confiables, Competitivos y con un Alto Valor Agregado</p>\r\n<p><strong>Lo invitamos a conocer mucho mas acerca de nuestros servicios recorriendo nuestro Sitio Web, donde encontrará toda la información acerca de nuestros servicios para la actividad petrolera, gasífera y minera</strong>.</p>', '', 'right'),
(10, 14, 0, '', '<p>Nuestra misión es proporcionar a nuestros clientes servicios de soporte a su operación central, aportando soluciones integrales y efectivas, que les permitan focalizarse en las actividades estratégicas de su negocio. &nbsp;</p><p>Para lograr esto contamos con una estructura interdisciplinaria compuesta por personal altamente capacitado en los campos específicos de interés de su empresa así como también con la última tecnología, esto sumado a la localización estratégica de nuestras oficinas y unidades regionales nos permite ofrecerles un servicio de excelencia.</p>', '', 'right'),
(11, 15, 0, 'Logueo de RMA', '<p>RMA</p>\r\n<a href="index?id_menu=admin_rma">Click Aqui</a>\r\n<p>Lograr la satisfacci&oacute;n total de nuestros clientes a trav&eacute;s de servicios de calidad, que nos conduzcan hacia el liderazgo de nuestro sector, as&iacute; como mantener el orgullo del personal que diariamente integra nuestros equipos de trabajo.</p>\r\n<p><strong>Caracter&iacute;sticas de nuestro equipo de trabajo:</strong></p>\r\n<ul>\r\n<ul>\r\n<li><strong>Puntualidad:</strong> Nos esforzamos por estar a tiempo en el lugar adecuado, cumpliendo el servicio ofrecido en el tiempo prometido con los m&aacute;s altos est&aacute;ndares de calidad.</li>\r\n</ul>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<ul>\r\n<li><strong>Responsabilidad:</strong> Cuidamos los detalles, ofrecemos garant&iacute;a en los procedimientos, nos comprometemos a trabajar en un nivel &oacute;ptimo de efectividad y eficiencia.</li>\r\n</ul>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<ul>\r\n<li><strong>Calidad total:</strong> Contamos con&nbsp; equipos de trabajo que est&aacute;n en la b&uacute;squeda continua de la calidad en cada una de las disciplinas que desarrollan.</li>\r\n</ul>\r\n</ul>\r\n<p>&nbsp;</p>', '', 'right'),
(2, 3, 0, '', '<p>El capital intelectual define la calidad de los servicios brindados \r\n                      por una empresa. Es por eso que en Lihué Ingeniería cuidamos \r\n                      a nuestra gente.</p><p>Conformamos un equipo multidisciplinario destacado por la calidad profesional \r\n                          y humana de sus miembros y una vasta experiencia en la tarea que realiza. \r\n                          Además contamos con convenios de cooperación tecnológica con reconocidas \r\n                          compañías del exterior, lo que nos permite cubrir necesidades de formación y \r\n                          actualización y, a la vez, responder a nuevos desafíos y necesidades que se\r\n                          plantean en el trabajo cotidiano.</p><p>El crecimiento de nuestra compañía y nuestro constante deseo de superación \r\n                          nos compromete con un riguroso plan de permanente capacitación que potencie \r\n                          el desarrollo de la carrera de nuestros profesionales.</p>', '', 'right'),
(3, 4, 0, '', '<p>Desde nuestros inicios hace más de 20 años, en Lihué Ingeniería \r\n                      nos enfocamos en la calidad. Para ello sabemos que debemos \r\n                      cuidar cada uno de los pilares de nuestro negocio: nuestra gente, \r\n                      nuestra tecnología e infraestructura y a nuestros clientes. </p><p>\r\n                    \r\n                      \r\n                        Nuestro ininterrumpido crecimiento -que se verifica a lo largo de los \r\n                          años con la apertura de nuevas unidades de negocios y la \r\n                          incorporación de más y mejores servicios- sólo fue posible por la \r\n                          constante adquisición de experiencia, el compromiso de todos los que \r\n                          formamos parte de Lihué con los valores de nuestra empresa, el cuidado del medio ambiente y la búsqueda de calidad que acompaña \r\n                          cada una de nuestras acciones.								</p>', '', 'right'),
(4, 5, 0, '', '<p><strong>Prov. de Buenos Aires. </strong><br />Tel.: (5411) 5273-4000 <br />Int. 5425-248 <br />Argentina.</p><p><strong>Prov. de Mendoza.</strong><br />Tel.: (54261) 476-4000 <br />Int. 5425-248<br />Argentina. </p><p><strong>Prov. de Neuquén.</strong><br />Tel.: (54299) 436-7706 <br />Int. 5425-248<br />Argentina. </p><p>Email : <a href="mailto:info@bravaingenieria.com.ar">info@bravaingenieria.com.ar</a></p>', '', 'right'),
(5, 6, 0, '', '<p>Nuestra experiencia\r\ny capacitación en cada una de las Áreas nos permite ofrecer soluciones\r\nintegrales, logrando satisfacer&nbsp; las\r\nnecesidades de nuestros clientes, a través de:<em><strong><br /></strong></em></p><ul><li><em></em>Un servicio global\r\nen el que ponemos a su disposición una visión innovadora, con una metodología\r\nde trabajo propia en la que prima la optimización de todos los recursos\r\nexistentes y necesarios.<strong></strong></li><li>Un servicio Puntual\r\ny Preciso, si su empresa tiene una necesidad concreta, nosotros le ofrecemos el\r\nservicio adecuado para dar respuesta a la misma. </li></ul><p><strong><em></em></strong></p>', '', 'right'),
(6, 12, 0, '', '<p><strong>BRAVA tiene un grupo propio de obra civil que diseña proyectos conformes a la solución que su empresa necesita.</strong></p>\r\n<ul>\r\n<li>En Brava buscamos la satisfacción de nuestros clientes utilizando las tecnologías y materiales que mejor se adapten a las necesidades de sus proyectos. \r\n<li>El planeamiento, trabajo en equipo y aplicación de la filosofía de la Calidad nos permite satisfacer las necesidades de nuestros clientes para que puedan cumplir con sus metas y objetivos. \r\n<li>Nuestros equipos de trabajo cuentan con profesionales y técnicos que brindaran su Know-How y experiencia para lograr una&nbsp; solución efectiva en cada proyecto. \r\n<li>La flexibilidad de nuestra empresa nos permite atender las necesidades de cada proyecto, cumpliendo con los estándares de Calidad, Seguridad y Medio Ambiente. \r\n<li>Contamos con equipamiento para poder responder de manera eficiente y segura ante los requirimientos de nuestros Clientes.</li></ul>', '', 'right'),
(7, 11, 0, '', '<p>Brava asume un compromiso contante con sus clientes satisfaciendo ampliamente las mayores exigencias y los requisitos reglamentarios aplicables, mejorando continuamente sus prestaciones y la eficacia del sistema de gestion de la calidad.</p><p><strong>La Calidad es un Factor Clave para alcanzar la excelencia</strong></p><p>Brava se sustenta en proveer servicios a la industria incursionando en el uso de nuevas tecnologías, buscando permanentemente la satisfacción del cliente.</p><p>También reconoce que la satisfacción del trabajo solo puede alcanzarse si todos los integrantes de la Empresa se sienten orgullosos de realizar eficientemente sus tareas, entendiendo que la Calidad no debe ser comprometida.</p><p>Los procedimientos por los cuales este compromiso debe ser alcanzado están fijados en el Manual de Calidad, remarcando la importancia de la contribución de cada miembro del personal en el logro de la calidad.</p><p>Es de vital importancia que todos los integrantes de nuestra empresa entiendan los requerimientos de Sistema de Gestión de Calidad y acepten su obligación de cumplirlos en sus áreas de actividad.</p><p><strong>Gestion de Calidad y Objetivos</strong></p><p>Brava dispone de una Gestión de Calidad estructurada por objetivos, teniendo en cuenta la satisfacción del Cliente. Estos objetivos abarcan toda la gestión de la Empresa.</p><p>Como resultado de la gestión, la Empresa dispone de indicadores de Calidad, los que son objeto de seguimiento y utilización para la mejora continua.</p><p>Dichos indicadores son presentados y comunicados al personal para su compromiso y motivación, demostrando el compromiso permanente de la Empresa con la Calidad.</p>', '', 'right'),
(8, 13, 0, '', '<p><strong>Para Brava tanto la productividad como la seguridad son la prioridad principal de nuestra Empresa.</strong></p><p>Nuestro elemento principal es nuestra gente, Sin la preservacion de los mismos nuestras actividades carecerian de valor alguno, es por tal motivo que nuetra empresa se basa en su politica de Seguridad e Higiene en el Trabajo, en todos sus niveles dentro del marco legal vigente.</p><p><strong>Pilares de Nuestros Servicios</strong></p><p>Es nuestro propósito es que todas las tareas que se realicen tanto en nuestras bases como en el campo se efectúen con el máximo de seguridad a través de una acción diaria y constante, como así la detección de y prevención de riesgos, a fin de evitar accidentes que puedan derivar en daños a las personas y bienes, sean estos de Brava o de nuestros Clientes.</p><p>Por ello es Responsabilidad indelegable de cada una de las personas que componen el personal de Brava Group, cumplir y hacer cumplir dicha política, así como la legislación vigente de Seguridad e Higiene en el trabajo.								</p>', '', 'right'),
(9, 9, 0, '', '<p>Brava, asume el compromiso de proteger la salud humana y el medio ambiente de los posibles imapctos de las actividades, productos y procesos que desarrollamos dentro del marco legal vigente.</p><p><strong>Responsabilidad y compromiso</strong></p>\r\n<p>Prioridad de la empresa: Preservar el Medio Ambiente dentro del marco legal, teniendo como objetivo la realización de nuestras actividades con el menor impacto posible para nuestro medio.</p><p>Mejora Continua del desempeño Ambiental: Mejorar en forma continua el sistema de Gestión Ambiental tomando como puntos de partida los requisitos legales y la revisión ambiental inicial.</p><p>Prevención de la Contaminación: Mantener actualizados nuestros procedimientos y prácticas operativas en forma de prevenir y reducir toda contaminación al Medio, controlar la generación de residuos y asegurar un manejo responsable de los mismos, reciclando y reutilizando todo lo posible.}</p><p>Cumplimiento de las normas, Leyes y Reglamentaciones Ambientales Vigentes: Cumplir con las Normativas Ambientales en la realización de todos nuestros servicios y tareas.</p><p>Uso Racional de los Recursos Naturales: es nuestra obligación preservar los Recursos Naturales mediante el uso racional de los mismos.</p><p>Capacitación y Concientización: Educar, Capacitar y Motivar a clientes, proveedores, subcontratistas y agente de la Empresa para que conduzcan sus actividades de una manera segura y responsable.</p>', '', 'right'),
(12, 16, 0, '', '<ul><li>Desarrollar&nbsp; aplicaciones como casos de éxito donde aportemos a nuestros Clientes nuestro know how como valor agregado&nbsp; al trabajo.</li><br /><li>Dar a nuestros Clientes la mejor opción de integración de acuerdo a los distintos requerimientos, considerando las necesidades técnicas y económicas de cada uno de ellos</li></ul><p><strong>Valor agregado al cliente:</strong></p><ul><li>Selección amplia de servicios desarrollados por personal capacitado en las áreas específicas de acción.</li><br /><li>Flexibilidad en los servicios, siempre brindado el mejor servicio con los más altos estándares de calidad y seguridad adaptándolo a los requerimientos del cliente.</li></ul>', '', 'right'),
(13, 17, 0, '', '<p>\r\n										Si\r\ndesea trabajar en un ambiente que le de la posibilidad de obtener un\r\ncompleto desarrollo personal y profesional.</p><p>Envíenos su currículum a <a href="mailto:info@bravaingenieria.com.ar">info@bravaingenieria.com.ar</a></p><p>Cuando surja la posibilidad de sumarse a nuestro equipo, nos pondremos en contacto con usted. </p><p>Le garantizamos absoluta confidencialidad y privacidad de los datos suministrados. </p>', '', 'right'),
(14, 26, 0, '', '<p>\r\n										Si\r\ndesea trabajar en un ambiente que le de la posibilidad de obtener un\r\ncompleto desarrollo personal y profesional.</p><p>Envíenos su currículum a <a href="mailto:info@bravaingenieria.com.ar">info@bravaingenieria.com.ar</a></p><p>Cuando surja la posibilidad de sumarse a nuestro equipo, nos pondremos en contacto con usted. </p><p>Le garantizamos absoluta confidencialidad y privacidad de los datos suministrados. </p>', '', 'right'),
(15, 19, 0, '', '<p>\r\n										Si\r\ndesea trabajar en un ambiente que le de la posibilidad de obtener un\r\ncompleto desarrollo personal y profesional.</p><p>Envíenos su currículum a <a href="mailto:info@bravaingenieria.com.ar">info@bravaingenieria.com.ar</a></p><p>Cuando surja la posibilidad de sumarse a nuestro equipo, nos pondremos en contacto con usted. </p><p>Le garantizamos absoluta confidencialidad y privacidad de los datos suministrados. </p>', '', 'right'),
(16, 23, 0, '', '<p>Si desea trabajar en un ambiente que le de la posibilidad de obtener un completo desarrollo personal y profesional.<br /><br />Envíenos su currículum a <a href="mailto:info@bravaingenieria.com.ar" target="blank">info@bravaingenieria.com.ar</a><br /><br />Cuando surja la posibilidad de sumarse a nuestro equipo, nos pondremos en contacto con usted. <br /><br />Le garantizamos absoluta confidencialidad y privacidad de los datos suministrados.</p>', '', 'right'),
(17, 30, 0, '', '<p>En Brava entendemos indispensable que todas las organizaciones conozcan, apliquen y cumplan con las normas de Calidad, Salud, Seguridad y Medioambiente existentes, ya que suponen una optimización de los procesos críticos de la empresa y son el único vehículo posible hacia la mejora continua. </p>\r\n<p>Fruto de ese planteamiento nace nuestro Departamento QHSE (Quality, Health, Safety &amp; Environment) con el fin de dar servicio a esas empresas que confían en las ventajas organizativas de un Sistema de Gestión Integrada (SGI), cuyo objetivo es promover la mejora de la calidad de los servicios y aumentar la postura preventiva con relación a las cuestiones de seguridad, medio ambiente y salud. </p>\r\n<div class="cap">Priorizamos el cuidado del medio ambiente y la utilización racional de sus recursos.</div>\r\n<div class="left">Establecemos e implementamos un <strong>Sistema de Gestión de Calidad, Medio Ambiente, Seguridad y Salud Ocupacional</strong>, teniendo en cuenta los múltiples beneficios que la misma brindará al desarrollo e integración de la empresa al mercado regional y nacional, con el aporte fundamental de nuestro personal, proveedores y clientes.</div>', '', 'right'),
(18, 31, 0, '', '<p><strong>SERVICIOS ADMINISTRATIVOS</strong></p><ul><li>Desarrollo de documentación especifica.</li><li>Desarrollo de planes para control administrativo durante la ejecución de proyectos.</li><li>Asesoramiento para la implementación de planes de control de gestión.</li><li>Auditoria e inspección de obras.</li><li>Control de documentación.</li><li>Análisis de Costos.								</li></ul>', '', 'right'),
(19, 31, 0, '', '<p><strong>SEGURIDAD E HIGIENE Y MEDIO AMBIENTE</strong></p><ul><li>Prevención de accidentes</li><li>Desarrollo y organización de políticas de seguridad, higiene y cuidado del ambiente acorde a los requerimientos legales vigentes.</li><li>Estadísticas y análisis sistemático de accidentes.</li><li>Adecuación de las condiciones de seguridad de los establecimientos, de acuerdo a legislaciones nacionales, provinciales y municipales.</li><li>Servicios externos de Seguridad e Higiene Laboral integrales en planta industrial u obra.</li><li>Determinación de riesgos potenciales y estudios de medidas correctivas.</li><li>Determinación de necesidades de uso de elementos de protección personal.</li><li>Confección de normas y procedimientos operativos de seguridad.</li><li>Auditorias de condiciones de seguridad laboral.</li><li>Capacitación en Manejo de productos tóxicos.</li><li>Seguimiento de Planes de Mejoramiento requeridos por las Aseguradoras de Riesgo del Trabajo (A.R.T.)								</li></ul>', '', 'right'),
(20, 31, 0, '', '<p><b>PREVENCIÓN DE INCENDIOS</b></p><ul><li>Evaluación de siniestrabilidad</li><li>Auditorias y adecuaciones de instalaciones industriales, administrativas o habitacionales de acuerdo al riesgo de incendio.</li><li>Auditorias y adecuaciones de instalaciones de almacenamiento, bocas de expendio de combustibles, plantas de fraccionamiento de petróleo y refinerías de combustibles, de acuerdo a la normativa legal.</li><li>Análisis de riesgos en el proceso de producción, almacenamiento y transporte de gas licuado, determinación de medidas de prevención y control de siniestros.</li><li>Protección contra incendios en tanques contenedores de hidrocarburos sobre nivel, a nivel y enterrados.</li><li>Determinación de necesidades de defensas activas y pasivas</li><li>Diseño de instalaciones de alarma y extinción a base de agua, espuma, polvo dióxido de carbono y compuestos especiales.</li><li>Análisis de riesgos en procesos.</li><li>Determinación de áreas de riesgo, selección de equipos eléctricos.</li><li>Elaboración de roles de incendio.</li><li>Formación y capacitación de brigadas contra incendio.</li><li>Determinación de vías de escape, señalización, rol de evacuación.</li><li>Roles de emergencias para riesgos de incendio o explosión.</li><li>Confección de normas, reglas y procedimientos para tareas que impliquen manejosde gases y/o líquidos, inflamables o combustibles.</li></ul>', '', 'right'),
(21, 31, 0, '', '<p><b>CALIDAD</b></p><ul><li>Implementación de métodos de control y políticas de calidad</li><li>Implementación de Sistemas de Gestión.</li><li>Instructivos de trabajo.</li><li>Procedimientos para el control de la calidad.</li><li>Requerimientos de ensayos no destructivos.</li><li>Control y designación de índices de control.</li><li>Asesoramiento para certificación ISO</li><li>Implementación de políticas de calidad.</li><li>Identificación de índices de Calidad.</li><li>Confección de Procedimientos generales y particulares.</li><li>Confección del manual de calidad.</li><li>Preparación de fichas de procesos.</li><li>Asesoramiento para la implementación.</li><li>Auditorías Internas.</li><li>Capacitación de personal.</li><li>Métodos para la mejora continúa</li><li>Implementación de los Procedimientos e Instructivos.</li><li>Análisis de índices de Calidad.</li><li>Control de Calidad de las tareas.</li><li>Asesoramiento para la implementación de un sistema de gestión.</li><li>Consultoría sobre los distintos métodos de mejora continúa.								</li></ul>', '', 'right'),
(22, 31, 0, '', '<p><strong>LOGÍSTICA</strong></p><ul><li>Desarrollo de sistemas logísticos.</li><li>Desarrollo e implementación de embalajes y medio transporte.</li><li>Análisis, evaluación y propuesta de mejora de recorridos.</li><li>Diseño y optimización de depósitos.</li><li>Análisis de propuestas de reducción de costo.</li><li>Gerenciamiento y tercerización de depósitos								</li></ul>', '', 'right'),
(24, 32, 0, '', '<p><strong>SEGURIDAD E HIGIENE Y MEDIO AMBIENTE</strong></p><ul><li>\r\n\r\nPrevención de accidentes</li><li>Desarrollo y organización de políticas de seguridad, higiene y\r\ncuidado del ambiente &nbsp;&nbsp;acorde a los\r\nrequerimientos legales vigentes. </li><li>\r\n\r\nEstadísticas y análisis sistemático de accidentes. </li><li>\r\n\r\nAdecuación de las condiciones de seguridad de los establecimientos,\r\nde acuerdo a legislaciones nacionales, provinciales y municipales. </li><li>\r\n\r\nServicios externos de Seguridad e Higiene Laboral integrales en\r\nplanta industrial u obra. </li><li>\r\n\r\nDeterminación de riesgos potenciales y estudios de medidas\r\ncorrectivas. </li><li>\r\n\r\nDeterminación de necesidades de uso de elementos de protección\r\npersonal. </li><li>\r\n\r\nConfección de normas y procedimientos operativos de seguridad. </li><li>\r\n\r\nAuditorias de condiciones de seguridad laboral. </li><li>\r\n\r\nCapacitación en Manejo de productos tóxicos. </li><li>\r\n\r\nSeguimiento de Planes de Mejoramiento requeridos por las\r\nAseguradoras de Riesgo del Trabajo (A.R.T.) </li></ul>', '', 'right'),
(38, 32, 0, '', '<p><strong>HIGIENE INDUSTRIAL Y CONTAMINACIÓN DEL MEDIO AMBIENTE</strong></p><ul><li>\r\n\r\nRecuperación de Suelos contaminados.</li><li>\r\n\r\nEstudios de impacto\r\nambiental</li><li>\r\n\r\nAyuda para la\r\nimplementación de Sistemas de Gestión Ambiental ISO 14000 </li><li>\r\n\r\nAuditorías\r\nAmbientales</li><li>\r\n\r\nGestión de Residuos</li><li>\r\n\r\nEstudio de contaminantes en el ambiente laboral. </li><li>Mantenimiento urbano.</li><li>\r\n\r\nProcedimientos de emergencias. </li><li>\r\n\r\nServicio de auditorías en contaminación y protección del medio ambiente.</li><li>\r\n\r\nConfección de planillas de severidad. </li><li>Mantenimiento urbano.</li><li>Forestación de Suelos.</li></ul>', '', 'right'),
(28, 33, 0, '', '<ul><li>Conservación y mantenimiento de la parte edificada de la propiedad, de sus instalaciones básicas y de los equipamientos de los que conste.</li><li>Conservación y mantenimiento de la parte no edificada de la propiedad; jardín, accesos, instalaciones exteriores.</li><li>Visitas programadas: Las tareas que se realizarán en estas visitas, serán las habituales para realizar las tareas de limpieza y mantenimiento.</li><li>Visitas especiales cuando las circunstancias y el cliente lo requiera. </li><li>Reestructuración y Modernización de Oficinas e Industrias.</li><li>Programación y coordinación de mudanzas y movimiento de personal.</li><li>Montajes Electromecánicos: Relevamiento, análisis, diagnostico y solución. </li><li>Dirección y ejecución de Instalación Eléctrica y Obra Civil complementaria.</li><li>Desarrollo y montaje de redes de Datos y Telefonía. </li><li>Ingeniería de Mantenimiento.				</li></ul>', '', 'right'),
(29, 33, 0, '', '<p><strong>MANTENIMIENTO\r\n</strong></p><ul><li>Planificación de mantenimiento Preventivo</li><li>Tercerización del mantenimiento.</li><li>Implementación de Software específicos de mantenimiento.				</li></ul>', '', 'right'),
(30, 33, 0, '', '<p><strong>SERVICIOS\r\n</strong></p><ul><li>Alquiler de Vehículos y Camionetas sin chofer.</li><li>Alquiler de Camiones con Hidrogrúas, Cargadoras, Moto niveladoras, etc.</li><li>Forestación de Suelos.				</li></ul>', '', 'right'),
(31, 33, 0, '', '<p><strong>DESARROLLO E IMPLEMENTACION DE SOLUCIONES INFORMATICAS</strong></p><p>Llevamos adelante en conjunto con nuestros clientes cada una de sus necesidades tratando de optimizar la relación costo/beneficio:\r\n\r\n    </p><ul><li>Relevamiento y análisis</li><li>Diseño </li><li>Planificación</li><li>Instalación</li><li>Implementación</li><li>Capacitación técnica</li></ul><p><strong>Mantenimiento</strong><br />Brindamos servicios adicionales para poder satisfacer las necesidades específicas de nuestros clientes: </p><ul><li>Soporte técnico especializado </li><li>Diseño y desarrollo web integral</li><li>Definición e implementación de políticas de seguridad de los datos.</li><li>Elaboración de presupuestos</li><li>Construcción, administración y mantenimiento de redes de datos.				</li></ul>', '', 'right'),
(33, 32, 0, '', '<p><b>PREVENCIÓN DE INCENDIOS</b></p><ul><li>Evaluación de siniestrabilidad</li><li>Auditorias y adecuaciones de instalaciones industriales, administrativas o habitacionales de acuerdo al riesgo de incendio.</li><li>Auditorias y adecuaciones de instalaciones de almacenamiento, bocas de expendio de combustibles, plantas de fraccionamiento de petróleo y refinerías de combustibles, de acuerdo a la normativa legal.</li><li>Determinación de necesidades de defensas activas y pasivas</li><li>Diseño de instalaciones de alarma y extinción de incendios.</li><li>Análisis de riesgos en procesos.</li><li>Determinación de áreas de riesgo, selección de equipos eléctricos.</li><li>Elaboración de roles de incendio.</li><li>Determinación de vías de escape, señalización, rol de evacuación.</li><li>Roles de emergencias para riesgos de incendio o explosión.</li><li>Confección de normas, reglas y procedimientos para tareas que impliquen manejosde gases y/o líquidos, inflamables o combustibles.</li><li>Capacitación In-company\r\n, outdoor y simulacros.</li></ul>', '', 'right'),
(35, 34, 0, '', '<p><strong>				Planificación y seguimiento de obras mecánicas, civiles.</strong></p><ul><li>Construcciones civiles.</li><li>Transporte y alquiler de equipos.</li><li>Limpieza y Forestación.</li><li>Movimiento de suelos.</li><li>Determinación del periodo de ejecución de la obra.</li><li>Programación y Seguimiento de Proyectos.</li><li>Determinación de recursos necesarios.</li><li>Análisis de materiales y equipos.</li><li>Tercerización de funciones y procesos.</li><li>Construcción en Base y Yacimientos con Personal Calificado.</li><li>Construcciones en Seco.</li><li>Pintura y Reparación de Obras.</li><li>Auditoria e inspección de obras.</li><li>Control de documentación. 				</li></ul>', '', 'right'),
(36, 34, 0, '', '<p><strong>Gerenciamiento de Proyectos (Project Managment)</strong></p><ul><li>Desarrollo de sistemas de gerenciamiento.</li><li>Desarrollo e implementación de métodos y capacitación del personal.</li><li>Análisis, evaluación y propuesta de mejoras.</li><li>Gerenciamiento y tercerización de obras de construcción.				</li></ul>', '', 'right'),
(37, 34, 0, '', '<p><strong>Mantenimiento</strong></p><ul><li>Planificación de mantenimiento Preventivo.</li><li>Tercerización del mantenimiento.</li><li>Implementación de Software específicos de mantenimiento. 				</li></ul>', '', 'right'),
